INSERT INTO `tbl_data_test` (`id`, `text`, `clean_text`, `user`, `created_at`, `label`) VALUES
(1534040477376270080, '@Dina4rtya Berapa waktu lalu kita ke Borobudur, ngak bisa naik keatas , akhirnya kita batalin masuk ke @BorobudurJogja , ngapain jauh jauh datang ngak bisa melihat langsung, sekarang tiket udah naik 750k mending uang nya di tabung...boros amat ... #BOROBUDUR #WISATAJOGJA', 'borobudur naik atas batal masuk lihat tiket naik uang tabung boros', 'ImeldaPutriAnis', '2022-06-07 05:12:05', 'negatif'),
(1534043779409317888, '@RANGERmounts @alisyarief @jokowi Pada belum pernah ke Hagia Sofia di Turki? Itu lebih tua dari Borobudur dan menunjukan bahwa constantinopel udah jauh lebih maju pada abad segitu. Berapa tiket masuk hagia sofia? Gratis.', 'hagia sofia turki tua borobudur tunjuk constantinopel maju abad segitu tiket masuk hagia sofia gratis', 'AnwaDroid', '2022-06-07 05:25:12', 'negatif'),
(1534043845620444928, '@susipudjiastuti Bu @susipudjiastuti sdh baca belum ttg tiket 750rb itu?\nTiket masuk kawasan Borobudur ttp Bu. Yg 750rn itu baik ke Candi nya.\n\nUtk melindungi candi dr kerusakan harusnya jangan dinaikkan harganya tp tutup akses naik candi.\n\nKayaknya Ibu sdh masuk barisan \'Baca Judul Abaikan Isi\'', 'bu baca tiket tiket masuk kawasan borobudur bu rn candi lindung candi rusa naik harga tutup akses naik candi kayak ibu masuk baris baca judul abai isi', 'Real_AdhiDompu', '2022-06-07 05:25:28', 'negatif'),
(1534050519324406016, 'Kalau tiket masuk Borobudur jadi 750 ribu auto anak muda domisili radius 30 km pacarannya cari lokasi lain. \n\nDulu kan emang sengaja sambil terangin relief dinding candi biar si dia terpesona.\n\nKembali rumah langsung putus, soale ga dijajanin dawet. Panas kan itu tempat.', 'tiket masuk borobudur auto anak muda domisili radius pacar cari lokasi kan sengaja angin relief dinding candi biar pesona rumah putus soale dijajanin dawet panas kan', 'TerapungKembali', '2022-06-07 05:51:59', 'negatif'),
(1534055140726309120, 'Memang enggak gampang. Tp kudu diusahakan. Soal tiket Candi Borobudur ini jadi momen untuk mulai memikirkan Cara menjaga situs sejarah lainnya', 'memang gampang usaha tiket candi borobudur momen pikir jaga situs sejarah', 'tantriwriter', '2022-06-07 06:10:21', 'positif'),
(1534093134589616128, '@alisyarief @jokowi Kalau merasa tiket masuk ke candi Borobudur terlalu mahal kan bisa pindah destinasi wisata ke candi Hambalang misalnya yg gratis, kenapa sih bapak nyinyir terus kalau ada solusinya?', 'tiket masuk candi borobudur mahal kan pindah destinasi wisata candi hambalang gratis nyinyir solusi', 'iam_zazha', '2022-06-07 08:41:20', 'positif'),
(1534095534855578112, 'Tulisan saya di @GNFI soal pro kontra harga tiket candi borobudur.\n\n\"...Jgn masyarakat kita tercerabut dari sejarahnya dan jangan pula warisan sejarah  ini terancam karena akomodatif  keinginan berwisata. Saya setuju agar warisan dunia ini tetap lestari!\n\nhttps://t.co/FsCbcvXZJC', 'tulis tuju kontra harga tiket candi borobudur masyarakat cerabut sejarah waris sejarah ancam akomodatif wisata tuju waris dunia lestari', 'just_fau', '2022-06-07 08:50:52', 'positif'),
(1534098259933011968, 'Kenaikan Tiket naik keatas stupa Candi borobudur menjadi Rp. 750.000 adalah harga yang sangat pantas. Mengingat situs sejarah dunia lainnya sudah sejak lama selangit harga tiketnya.. Dengan begitu kita bisa sama2 melindungi dan melestarikan situs sejarah. \nhttps://t.co/MeITcrheUU', 'naik tiket naik atas stupa candi borobudur harga ingat situs sejarah dunia langit harga tiket lindung lestari situs sejarah', 'GueTionghoa', '2022-06-07 09:01:41', 'positif'),
(1534107634617356032, 'Ternyata ehhh... ternyata mahal nya tiket masuk candi borobudur di karnakan adanya patung Dewa Cebong diatas candi ???????????????? https://t.co/BHVn92gYDM', 'mahal tiket masuk candi borobudur patung dewa atas candi', 'SudahToh', '2022-06-07 09:38:57', 'negatif'),
(1534128221662245120, '@kompascom kalau tujuannya membatasi pengunjung Borobudur agar mengurangi kerusakan, lebih baik pakai sistem tiket seperti di bioskop. Jadi ada jam kunjung dan lama waktu kunjung nya per sesi. Jangan batasin pakai harga...', 'tuju batas unjung borobudur kurang rusa pakai sistem tiket bioskop jam kunjung kunjung sesi batasin pakai harga', 'herbertkusno', '2022-06-07 11:00:45', 'negatif'),
(1534134227217920000, 'Jika ingin menjaga ORIGINALITASI Borobudur Berlakukan Saja DENDA dari pada harus menaikan TIKET \n\nKarna para generasi muda dan penerus bangsa juga Wajib tau sejarah peradaban yang pernah terjadi pada masa lampau di indonesia...', 'jaga originalitasi borobudur laku denda naik tiket generasi muda terus bangsa wajib sejarah adab lampau indonesia', 'Catatan_ali7', '2022-06-07 11:24:37', 'negatif'),
(1534238874880179968, 'Setuju tiket naik candi borobudur mahalin aja. \nUntuk menjaga kesucian tempat ibadah milik Umat Budha. https://t.co/8tSQMsezAV', 'tuju tiket naik candi borobudur mahalin jaga suci ibadah umat budha', 'PRIHONGGO', '2022-06-07 18:20:27', 'positif'),
(1534304669132280064, '@kompascom Harusnya di pertimbangkan  tiket masuk candi Borobudur. Tidak memberatkan masarakat dan pikirkan juga biaya pemeliharaan  jika terjadi kerusakan  pada bagian candi itu harus di pertimbangkan .', 'timbang tiket masuk candi borobudur berat masarakat pikir biaya pelihara rusa bagi candi timbang', 'gesmawati', '2022-06-07 22:41:53', 'negatif'),
(1534322171266597120, 'Jika Memang Benar..Maka saya berterimakasih Pada Pemerintah, Karena Menunda Tarif Tiket Naik Ke Candi Borobudur\nWalaupun Itu bukan Kehendak hati, Tapi karena Tekanan Rakyat akan Pentingnya Mencintai Budaya Bangsa', 'memang benar maka terima kasih perintah tunda tarif tiket naik candi borobudur hendak hati tekan rakyat cinta budaya bangsa', 'Bagudek67', '2022-06-07 23:51:26', 'negatif'),
(1534325081098158080, 'Membatasi dan menaikkan tiket wisatawan untuk naik ke Candi Borobudur adalah hal yg patut di berlakukan demi kelestariannya.\nCandi Borobudur adalah warisan leluhur, wajib kita rawat dan lestarikan\n\nIngat ya yang dimahalkan itu tiket untuk Naik ke Candi bukan masuk kawasan Candi https://t.co/siN1RrJTEH', 'batas naik tiket wisatawan naik candi borobudur patut laku lestari candi borobudur waris leluhur wajib rawat lestari ingat iya mahal tiket naik candi masuk kawasan candi', 'garuda080', '2022-06-08 00:03:00', 'positif'),
(1534327119236301056, 'Di tengah berita Borobudur, gue sih setuju dgn tiket 750rb. Itu tempat ibadah, sakral, dan bersejarah. Sudah selayaknya untuk membatasi dan ga sembarang org bisa naek, biar bisa lebih menghargai bahwa untuk kesana ga murah dan perlu effort', 'berita borobudur tuju tiket ibadah sakral sejarah layak batas sembarang naik biar harga kesana murah effort', 'diahksm', '2022-06-08 00:11:06', 'positif'),
(1534333116135132928, 'Gw sndiri mndukung kenaikan harga tiket tuk naik ke bangunan Candi Borobudur. Pastinya aturan ini dibuat tuk melindungi cagar budaya ini agar tak rudak krna kelebihan beban dr pengunjung candi. Apalagi banyak pengunjung yg tak bertanggung jawab https://t.co/OeMCsK49OO', 'mndukung naik harga tiket tuk naik bangun candi borobudur pasti atur buat tuk lindung cagar budaya rudak lebih beban unjung candi unjung tanggung jawab', 'catatankaqihati', '2022-06-08 00:34:56', 'positif'),
(1534338466775020032, 'Mari kita mendukung kenaikan harga tiket demi menjaga kelestarian kekayaan dan budaya nusantara...\nAyo kita dukung kelestarian Candi Borobudur sebagai salah satu warisan budaya dari nenek moyang kita...\nBorobudur merupakan salah satu warisan kebanggaan milik Indonesia ???????? https://t.co/8XGiXP39cI', 'mari dukung naik harga tiket jaga lestari kaya budaya nusantara ayo dukung lestari candi borobudur salah waris budaya nenek moyang borobudur salah waris bangga indonesia', 'KangCendol_33', '2022-06-08 00:56:11', 'positif'),
(1534344881879265024, '@hipohan Karena tiket borobudur yang 750 rb HANYA untuk yang naik keatas candi demi melestarikan peninggalan sejarah tak ternilai. Tiket masuk nya tetap 50 rb .. faham ?\nBeda dengan formula O eh E .. buat nonton layar tancap kan..', 'tiket borobudur naik atas candi lestari tinggal sejarah nilai tiket masuk faham beda formula o e nonton layar tancap kan', 'fauzan69899430', '2022-06-08 01:21:41', 'positif'),
(1534351648432067072, 'Harga tiket untuk naik ke Candi Borobudur adalah Rp750.000. Tapi untuk masuk kawasannya, harganya masih tetap.\n\nTernyata alasan di balik naiknya harga tiket adalah untuk mengurangi jumlah pengunjung yang naik ke atas Candi.', 'harga tiket naik candi borobudur masuk kawasan harga alas naik harga tiket kurang unjung naik candi', 'gitayolandaa', '2022-06-08 01:48:34', 'positif'),
(1534353346324094976, 'harga masuk kan ga dinaikin ya, wisatawan ttp bs liat borobudur dr bawah. kl mau naik, baru pake harga tiket yang 750k. tujuannya apa? biar ga overtourism, tau sendiri namanya situs bangunan heritage gini rentan rusak dmn pas kmrn pada boleh naik itu stupa2 uda dikasi tau-', 'harga masuk kan naik iya wisatawan lihat borobudur naik pakai harga tiket tuju biar overtourism nama situs bangun heritage rentan rusak pas naik stupa kasi', 'zeromileu', '2022-06-08 01:55:19', 'positif'),
(1534381929054686976, 'Rame ya wacana candi Borobudur. Pada protes tiket naik Candi 750rb blablabla\nMasuk masjid kan gratis, kok jarang pada masuk?\n\n#SelfReminder', 'ramai iya wacana candi borobudur protes tiket naik candi blablabla masuk masjid kan gratis jarang masuk', 'MahadikaZ', '2022-06-08 03:48:53', 'negatif'),
(1534398048218264064, 'Tidak perlu marah2 dg rencana kenaikan harga tiket utk naik ke Candi Borobudur... masih ada koq Candi Hambalang... bisa masuk kapan saja dan tdk perlu bayar.. kalian malah bisa aja keluarga sekalian adu nyali.', 'marah rencana naik harga tiket naik candi borobudur candi hambalang masuk bayar keluarga adu nyali', 'soesintho007', '2022-06-08 04:52:57', 'negatif'),
(1534398588205568000, '@rasjawa penetapan harga tiket masuk borobudur ga musyawarah dulu ama bikhu, suka suka dia aja gitu, diputusin sendiri aja', 'tetap harga tiket masuk borobudur musyawarah biksu suka suka putus', 'kecovva', '2022-06-08 04:55:05', 'negatif'),
(1534431439407972096, '@e2oliHhZSkBYTFc @detikcom Gak ada urusan sama agama. Tiket mahal hanya utk turis. Mau ibadah, penganut Buddha punya vihara yg rutin bisa sering2 dikunjungi. Borobudur hanya ibadah tahunan, dan tidak perlu tiket kalau ibadah. \n\nJangan baca berita sepotong2lah... Apalagi jurnalis detik kayak jin Ancol gini.', 'urus agama tiket mahal turis ibadah anut buddha vihara rutin kunjung borobudur ibadah tahun tiket ibadah baca berita potong jurnalis detik jin ancol', 'TongTji789', '2022-06-08 07:05:38', 'positif'),
(1534464643929980928, 'Once harga naik, maka harga gak mungkin/jarang sekali turun. Contoh harga apartemen, harga tiket wahana, harga masuk Borobudur (ups). Kenapa? Why begini?', 'once harga naik maka harga mungkin jarang turun contoh harga apartemen harga tiket wahana harga masuk borobudur why', 'kegankusuma', '2022-06-08 09:17:34', 'negatif'),
(1534557455467785984, '[Masih soal Borobudur]\n\nMasuk pelataran Borobudur 50rb.\n\nMau keatas Borobudur, bayar tiket 750rb.\n\nOrg misqueen cuma nyampe di pelataran sambil minum es krim,ngeliatin horang kayah naik keatas candi Borobudur. Mau 1 org, 2 org, ato se RW, dapet tour guide.\n\nMsh blg konservasi?', 'borobudur masuk latar borobudur atas borobudur bayar tiket misqueen nyampe latar minum es krim ngeliatin horang kayah naik atas candi borobudur rw tour guide bilang konservasi', 'boyke_bond_Jr', '2022-06-08 15:26:22', 'negatif'),
(1534612039166897920, '@ZaenalAmmar @IT19S20 @hipohan gue tuh bingung,kalo tujuannya adalah membatasi pengunjung naik ke candi knp gak langsung dibatasi aja perhari dgn cara tiket naik dijual terpisah via online.Kalo begini kesannya hanya orang yg mampu yg bisa naik ke candi borobudur...just an idea', 'bingung tuju batas unjung naik candi batas hari tiket naik jual pisah via online kesan naik candi borobudur just idea', 'RullyTawang', '2022-06-08 19:03:16', 'negatif'),
(1534677082046729984, '@detikcom borobudur tiket 2 jt pun tidak masalah,  kita cari destinasi wisata yg lain aja, yg murah tapi tidak kalah menarik,,,ngapain  masuk borobudur klo tiketnys sama dg kita naik pesawat,,,', 'borobudur tiket cari destinasi wisata murah kalah tarik masuk borobudur tiketnys naik pesawat', 'RSugihantoro', '2022-06-08 23:21:43', 'negatif'),
(1534688085333511936, 'Candi Borobudur merupakan cagar budaya bertaraf internasional.\n\nLangkah pemerintah sudah tepat untuk menaikkan tiket masuk ke Candi Borobudur dan sudah dipertimbangkan dengan matang sesuai dengan tiket ikon wisata dunia.\n\nMari kita menjaga destinasi wisata dunia Candi Borobudur. https://t.co/m4oY7fcfnJ', 'candi borobudur cagar budaya taraf internasional langkah perintah naik tiket masuk candi borobudur timbang matang tiket lambang wisata dunia mari jaga destinasi wisata dunia candi borobudur', 'kalla_jengking', '2022-06-09 00:05:27', 'positif'),
(1534730281042599936, 'kesel sendiri liat orang yang kontra sama harga kenaikan tiket. pdahal udah dijelasin, kalo untuk anak sekolah harga tiket buat ke atas tetep sama harganya T_T w awalnya tim kontra, tapi setelah dnger candi borobudur bebatuannya udah mulai aus serem bgt anjir', 'kesal lihat kontra harga naik tiket anak sekolah harga tiket harga t t w tim kontra dengar candi borobudur bebatuan aus rem banget', 'itarizukaa', '2022-06-09 02:53:07', 'positif'),
(1534753321847688960, '@merdekadotcom Bukannya mikir pake otak, malah merasa Terzholimi!???\nWoiii, Jangan kau naikkan Tiket ke Borobudur makanya !', 'bukan pikir pakai otak terzholimi woiii naik tiket borobudur', 'Dorraemon_', '2022-06-09 04:24:40', 'negatif'),
(1534760148614361088, '@merdekadotcom Tiket naik dari rp 50.000 jadi rp 750.000.\nNaik 15x lipat.\nEmangnya yg bikin Borobudur Luhut?\nLuhut itu punya otak dan hati tidak?\nDi usia 74 tahun harusnya Luhut dipensiunkam. Bukan malah merangkap puluhan jabatan dan pekerjaam', 'tiket naik naik x lipat memang bikin borobudur otak hati usia dipensiunkam rangkap puluh jabat pekerjaam', 'nizaminz', '2022-06-09 04:51:48', 'negatif'),
(1534836849067589888, 'Tapi terserah aje ye... Ini argumen gw soal mahalnya tiket masuk Candi Borobudur. Kalo bilang harga tiket masuk Candi Borobudur 750 ribu itu wajar terserah aje dah. Gw paling males berdebat dengan orang yang akalnya ga berjalan dengan sehat.', 'serah aje iya argumen mahal tiket masuk candi borobudur bilang harga tiket masuk candi borobudur wajar serah aje malas debat akal jalan sehat', 'diva_acm', '2022-06-09 09:56:35', 'positif'),
(1534857273037598976, '@tvOneNews Kl sukses masuk borobudur pake tiket mahal, siap2 tempat ibadah yg lain bakalan kena, maklum bisnis PCR dah bangkrut ????', 'sukses masuk borobudur pakai tiket mahal ibadah kena maklum bisnis pcr bangkrut', 'capt_10R174', '2022-06-09 11:17:44', 'negatif'),
(1534899728517067008, 'Untung dibatalin. Bikin kebijakan kok ngetes netizen https://t.co/Q4Ak43ahoA', 'untung batal bikin bijak ngetes netizen', 'panca66', '2022-06-09 14:06:26', 'negatif'),
(1535049187163001088, 'Langkah ini (menaikkan tiket masuk Borobudur) dilakukan semata-mata demi menjaga kelestarian kekayaan sejarah dan budaya nusantara.\nRencana kenaikan tarif baru itu  demi menjaga kelestarian Candi Borobudur dan membatasi kunjungan.\n@jokowi pro budaya https://t.co/Kys94UKzV2', 'langkah naik tiket masuk borobudur mata jaga lestari kaya sejarah budaya nusantara rencana naik tarif jaga lestari candi borobudur batas kunjung tuju budaya', 'Anggita_lung', '2022-06-10 00:00:20', 'positif'),
(1535053742579429120, '2. Pemberdayaan umkm juga masih bisa berjalan dengan baik krn tiket masuk pelataran masih harga normal .. bukankah di pelataran Borobudur sudah disediakan tempat berjualan ..?', 'daya umkm jalan tiket masuk latar harga normal latar borobudur sedia jual', 'ngaprak_nusa', '2022-06-10 00:18:26', 'positif'),
(1535054346794115072, 'Aturan pengendalian jumlah pengunjung Candi Borobudur setiap harinya dengan menaikkan tiket naik ke atas bangunan candi.\n\nBeban candi bisa berkurang sebab effek pelapukan &amp; iklim, terhindar vandalisme, cagar budaya lebih aman.\nKelestarian kekayaan &amp; budaya nusantara bisa terjaga. https://t.co/JPU9HWrgZE', 'atur kendali unjung candi borobudur hari naik tiket naik bangun candi beban candi kurang efek lapuk iklim hindar vandalisme cagar budaya aman lestari kaya budaya nusantara jaga', 'Penyair_Berdiri', '2022-06-10 00:20:50', 'positif'),
(1535079012149920000, '@OposisiCerdas Meresahkan masyarakat Indonesia. Apa apa naik. Selalu memeras rakyat nya. Dan para turis pun mikir Dua kali lipat mau ke Borobudur karena tiket mahal.', 'resah masyarakat indonesia naik peras rakyat turis pikir lipat borobudur tiket mahal', 'Kasihtiara81', '2022-06-10 01:58:51', 'negatif'),
(1535593580684685056, '@detikcom Menaikan harga tiket masuk candi borobudur tanpa berpikir,sama dgn membunuh perekonomian masyarakat disekitarnya serta membutakan sejarah bg anak2 muda.', 'naik harga tiket masuk candi borobudur pikir bunuh ekonomi masyarakat sekitar buta sejarah anak muda', 'PrizalEmi', '2022-06-11 12:03:34', 'negatif'),
(1536548213620023040, '@yunartowijaya Pendapatan umkm warga sekitaran borobudur bertumpu pada wisatawan lokal,saya sebagai warga sekitaran borobudur menolak harga tiket masuk yg gak masuk akal mahalnya,kasihan para pedagang di sekitaran candi borobudur.karena akan sepi wisatawan lokal enggan ke borobudur', 'dapat umkm sekitar borobudur tumpu wisatawan lokal sekitar borobudur tolak harga tiket masuk masuk akal mahal kasihan dagang sekitar candi borobudur sepi wisatawan lokal enggan borobudur', 'sardiyo25400798', '2022-06-14 03:16:56', 'negatif'),
(1536953660361477888, '@convomf Nah gitu dong, dikira warga Indo pada sultan2 semua kali ya jd tiket candi borobudur dibikin mahal.\nMinat pengunjung lokal udah minim ditambah naikin harga tiket masuk, makin gak ada yg mau kesana.', 'indo sultan iya tiket candi borobudur bikin mahal minat unjung lokal minim tambah naik harga tiket masuk kesana', 'ladyemynarnen', '2022-06-15 06:08:02', 'negatif');
INSERT INTO `tbl_data_train` (`id`, `text`, `clean_text`, `user`, `created_at`, `label`) VALUES
(1534039882229686016, '@RAS01321241 @Dennysiregar7 @cokro_tv Dari zaman saya msh bocil, Borobudur itu tempat wisata. Ya nalar aja, kalau tempat ibadah kok ya pakai tiket masuk? Tempat ibadah mana yg kudu bayar kalau mau masuk?', 'zaman bocil borobudur wisata iya nalar ibadah iya pakai tiket masuk ibadah bayar masuk', 'TriaAtmajaa', '2022-06-07 05:09:43', 'negatif'),
