(1534158390422778112, 'Gue sih setuju bgt kalo tiket naik ke candi Borobudur jadi 750k, kl perlu 1 jt sekalian &amp; tegasin penjaga di situ biar orang2 ga bisa usil lagi.\n\nEmg kebanyakan masyarakat Indo cara negasinnya kalo ga dgn harga mahal ya digalakin. Tp kalo ngeyel digalakin nanti lapor ke sosmed ????????? https://t.co/XUpadmlAk6', 'tuju banget tiket naik candi borobudur jaga biar usil memang banyak masyarakat indo harga mahal iya galak ngeyel galak lapor sosial media', 'sindhukaton', '2022-06-07 13:00:38', 'positif'),
(1534158607817712128, 'Jika memang harga tiket masuk Borobudur dimahalkan maka pemerintah harus ketat mengawasi dan sepenuhnya membiayai perawatan situs penting dunia ini. \n\nJangan ada alasan; tidak ada dana maintenance Borobudur dengan apasan tidak adanyanya dana masuk karena sepinya penjualan tiket.', 'memang harga tiket masuk borobudur mahal maka perintah ketat awas sepenuh biaya awat situs dunia alas dana maintenance borobudur apas adanyanya dana masuk sepi jual tiket', 'Nugroho11Eko', '2022-06-07 13:01:30', 'negatif'),
