(1534350769360883968, 'Lain kali kalau ngga mau tiket naik Candi Borobudur naik, kita harus ikut merawat situs budaya, ngga usah coret-coret Stupa atau naikin Stupa.\n\nSelalu ingat juga, cari informasi lebih lanjut dan akurat biar ngga jadi korban hoax!', 'tiket naik candi borobudur naik rawat situs budaya coret coret stupa naik stupa ingat cari informasi akurat biar korban isu bohong', 'awaltawakal', '2022-06-08 01:45:04', 'positif'),
