(1534387639146749952, 'Gue setuju tiket Borobudur dibikin mahal buat warga, dan murah buat pelajar. Buat orang yg teriak2 kemahalan... Borobudur itu warisan budaya, bukan tempat wisata. Bahkan tempat sembahyang org Budha. Masih banyak tempat wisata yg terjangkau buat ekonomi menengah kebawah. Jgn bacot', 'tuju tiket borobudur bikin mahal warga murah ajar teriak mahal borobudur waris budaya wisata sembahyang budha wisata jangkau ekonomi tengah bawah bicara', 'Harmonilisabet', '2022-06-08 04:11:35', 'positif'),
(1534390186087289088, 'Mengoreksi stance pribadi soal tiket masuk Borobudur yg 750rebu itu. Lebih acceptable kalo pengunjung dibatasi aja, jamnya juga dibatasi, perbanyak \"satpam\" biar tegas sama pengunjung yg ngerusak.\nUtamakan buat ibadah. 750rb bikin ia cuma accessible bagi yg privileged. :(', 'koreksi stance pribadi tiket masuk borobudur acceptable unjung batas jam batas banyak satu aman biar unjung rusak utama ibadah bikin accessible privileged', 'tipaa', '2022-06-08 04:21:42', 'negatif'),
(1534409689395790080, 'Nah! Ini putusan baik. Jgn ditunda, batalin aja. Biar gak ribut. Negara wajib menjaga &amp; merawat warisan budaya. Rakyat jgn diajak iuran\n\nGanjar-Luhut Sepakat Tunda Rencana Kenaikan Harga Tiket Borobudur | CNN Indonesia | LINE TODAY https://t.co/n3GemwvkTz #LINETODAY #CNNIndonesia', 'putus tunda batal biar ribut negara wajib jaga rawat waris budaya rakyat ajak iur sepakat tunda rencana naik harga tiket borobudur indonesia', 'Mafirion', '2022-06-08 05:39:12', 'negatif'),
(1534411720126435072, 'Denda besar bisa tapi problemnya di Borobudur yg gue baca adalah pada buta huruf fungsional.\n\nArtinya perlu brp banyak petugas buat melakukan pengawasan yg mana itu cost lg dan gatau pengelola mau nanggung itu atau membebankan ke harga tiket atau ditanggung pemerintah gajinya. https://t.co/OU0x5BSjLH', 'denda problem borobudur baca buta huruf fungsional tugas laku awas cost kelola nanggung beban harga tiket tanggung perintah gaji', 'salahsambungya', '2022-06-08 05:47:16', 'positif'),
(1534421763777383936, '@jokowi mohon maaf pak, Tiket Borobudur yg mahal di protes masyarakat karena merugikan semua sektor ekonomi dan pariwisata, ini lah akibat buat kebijakan tdk pernah menelaah dampak sosial bgi kebaikan masyarakat, seperti omnibuslow ternyata kebaikan ny tdk ada,', 'mohon maaf tiket borobudur mahal protes masyarakat rugi sektor ekonomi pariwisata akibat bijak telaah dampak sosial baik masyarakat omnibuslow baik', 'Fathur32567330', '2022-06-08 06:27:11', 'negatif'),
(1534422950186974976, 'Gapapa naikin aja tu harga tiket borobudur tapi turunin harga tiket konser kpop..', 'gapapa naik harga tiket borobudur turunin harga tiket konser kpop', 'luxyriz', '2022-06-08 06:31:54', 'positif'),
(1534423110362856960, '@ganjarpranowo Maaf pak, aturan tiket borobudur yg mahal bukan cuma di tunda tapi hrus di batalkan dan di hapus supaya tdk bisa keluar lgi itu kebijakan yg merugikan masyrkat baik ekonomi maupun pariwisata, Itu aturan yg tdk jelaa dn tdk melihat dampak buruk sosialnya', 'maaf atur tiket borobudur mahal tunda batal hapus keluar bijak rugi masyrkat ekonomi pariwisata atur jelaa lihat dampak buruk sosial', 'Fathur32567330', '2022-06-08 06:32:32', 'negatif'),
(1534430445563019008, 'Harga tiket reguler skrg berapa ya? 750rb itu murah kali! Itu sebabnya, jadikan Candi Borobudur itu tempat ibadah. Naik Haji, UMROH berapa tuh?! Yaa tapi, kalau 750rb msih terlalu mahal, yaudah 450rb aja deh! Sesuai angka tahun kemerdekaan NKRI, 1945. @luhut_binsar @ganjarpranowo https://t.co/74aX4x4NSb', 'harga tiket reguler iya murah jadi candi borobudur ibadah naik haji umroh iya mahal iya angka merdeka nkri', 'kaspito', '2022-06-08 07:01:41', 'positif'),
(1534442501167144960, '@venomest1 Bukan tiket masuk ya..tiket naik ke candi nya..dan itu blm final.kalo tiket masuk masih sama 50rbu. Pembatasan naik ke monumen krn kondisi borobudur yg mmg sudah renta dan pelapukan batu serta mengalami penurunn tiap tahunnya...', 'tiket masuk iya tiket naik candi final tiket masuk batas naik monumen borobudur memang renta lapuk batu alami turun tahun', 'SaputraBerman', '2022-06-08 07:49:35', 'positif'),
(1534442884514337024, 'Setuju tiket naik KeBorobudur. Kalau bisa wisatawan dilarang naik keatas,cukup dihalaman/taman seputaran candi. Candi borobudur adalah tempat suci /tempat beribadah bagi umat budha,juga menjadi warisan dunia. Maka dari itu,hormatilah..????????', 'tuju tiket naik borobudur wisatawan larang naik atas halaman taman putar candi candi borobudur suci ibadah umat budha waris dunia maka hormat', 'KetutAr95847491', '2022-06-08 07:51:06', 'positif'),
(1534444526710190080, '@alisyarief @jokowi Dulu prnh blng ke Borobudur haram sekarang untuk naik stupa harga dinaikkan nyocot,,warga +62 itu susah diatur tmpt ibadah di injak2 buat mesum di angkor gk boleh sembarangan,,disini tiket msk tetep 50 ribu yg 750 itu yg naik ke candi dikasih harga mahal biar gk sembarangan naik', 'bilang borobudur haram naik stupa harga naik nyocot warga susah atur ibadah injak mesum angkor sembarang sini tiket masuk naik candi kasih harga mahal biar sembarang naik', 'wulandari_aria', '2022-06-08 07:57:38', 'positif'),
(1534455521310170880, 'Harga tiket Borobudur lagi murah aja pada ga ngunjungin, giliran harga naek baru bilang, \"ga akan pernah bisa ngunjungin.\"\n\nPelajari dulu alasannya kenapa harga tiketnya naik, adanya pembatasan kunjungan dan larangan memasuki/memanjat area Candi yang paling dalam.', 'harga tiket borobudur murah ngunjungin gilir harga naik bilang ngunjungin ajar alas harga tiket naik batas kunjung larang pasuk panjat area candi dalam', 'satembek', '2022-06-08 08:41:19', 'positif'),
(1534464050402234112, '@Rani_Kancana Ne\' aku lebih setuju tiket naek borobudur lebih dr 1jt... tapi nggo wong² sing memang mau penelitian... arep iibadah... pengen explore lebih dalam opo mahasiswa sing mau skripsi tentang borobudur harus dibantu dan diwenehi pemandu khusus', 'tuju tiket naik borobudur memang teliti arep ibadah explore dalam mahasiswa skripsi borobudur bantu diwenehi pandu', 'Supriya77456669', '2022-06-08 09:15:13', 'positif'),
(1534464974596124928, '@MNW_MNW_MNW Hadeuuuuuh ..... bikin FPI palsu  ini pake anggaran siapa yak...??? Jangan hamburin duit rakyat dunk ...ntar naikin tiket borobudur, naikin ppn, bikin aturan pajak gak jelas , naikin bbm untuk hal-hal yg gak manfaat kek gini .....', 'bikin palsu pakai anggar iya hamburin uang rakyat naik tiket borobudur naik ppn bikin atur pajak naik bbm manfaat', 'Nunjauhdisono', '2022-06-08 09:18:53', 'negatif'),
