(1534469286420353024, 'Awalnya kaget dan kayak nggak habis pikir gitu ketika denger wacana pemerintah untuk menaikkan tiket masuk kawasan borobudur. Ternyata, setelah cari-cari info lagi, bangunan itu penuh nilai historis dan nilai keagamaan, serta tempat untuk beribadah. https://t.co/4HXv2eMwN3', 'kaget habis pikir dengar wacana perintah naik tiket masuk kawasan borobudur cari cari informasi bangun penuh nilai historis nilai agama ibadah', 'tevanye', '2022-06-08 09:36:01', 'positif'),
(1534471723667845120, 'Lagian kalo tiket borobudur naek, kasian biksu Tom Sam Cong, masa iye dia sampe di Magelang, cuma masuk ke museumnya doang', 'lagi tiket borobudur naik kasi biksu banci iya magelang masuk museum', 'bayarduaribu', '2022-06-08 09:45:42', 'negatif'),
