(1534492054394667008, '@alisyarief @jokowi Masuk Istiqlal pake tiket baru elu ngoceh, Drun. Kalo borobudur digratisin, apa gak khawatir elu dan golongan elu bakalan murtad massal? Sekali2 positif thinking laaah biar hati elu gak kotor', 'masuk istiqlal pakai tiket ngoceh borobudur gratis khawatir golong murtad massal positif thinking biar hati kotor', 'FMakme', '2022-06-08 11:06:29', 'positif'),
(1534496233527489024, '@cobeh2021 Hmm tiket Mahal? apakah ini tujuan sebenarnya? Selain umat budha Tak boleh masuk?\nHmm barusan 2021 kemarin kesana merasa janggal aja areanya&amp;hotel yg didalam!Jangan claims itu milik Budha, itu milik Rakyat Indonesia ????????????Maaf bebaskan bagi generasi kita mengunjungi Borobudur ???????????? https://t.co/FWcFhyW44s', 'tiket mahal tuju umat budha masuk barusan kesana janggal area hotel dalam claims budha rakyat indonesia maaf bebas generasi unjung borobudur', 'AfasaSembilan', '2022-06-08 11:23:06', 'negatif'),
