(1534502468901474048, '@yashadipura Boleh juga..\nTpi klo pihak saudara kita yg Budha jg masih mengisinkan utk dikunjungi oleh saudara2 sebangsanya jg gpp kali ya..\n\nTpi jgn dong tiket sampe 750 ribu an lah..\n\nKami jg sdh berkunjung k Borobudur ????????????', 'saudara budha mengisinkan kunjung saudara bangsa iya tiket kunjung borobudur', 'YezUmmu', '2022-06-08 11:47:52', 'negatif'),
(1534505290514584064, 'Pak menko marves, usulan untuk menaikan tiket candi Borobudur menjadi 750000 rupiah mohon dipending dulu, kepala aku sakit memikirkannya, itu mahal sekali, untung aku udah kesana, kasihan yang belum', 'menko marves usul naik tiket candi borobudur mohon pending kepala sakit pikir mahal untung kesana kasihan', 'a_rafianti', '2022-06-08 11:59:05', 'negatif'),
(1534517513144267008, '@hahahanipu 750rb mah terlalu murah.. yang wajar tuh 1.5jt buat Borobudur.... Ayo dukung 1.5jt tiket masuk Borobudur... (Biar cuma jin dan dedemit yg berkunjung)', 'mah murah wajar borobudur ayo dukung tiket masuk borobudur biar jin dedemit kunjung', 'Rahmath45499067', '2022-06-08 12:47:39', 'positif'),
(1534528806110629888, '@detikcom Tiket Borobudur 750 tidak mahal karena ini objek wisata yang bukan buatan manusia sekarang , Borobudur termasuk benda keajaiban dunia', 'tiket borobudur mahal objek wisata buat manusia borobudur benda ajaib dunia', 'Sahlan80206587', '2022-06-08 13:32:32', 'positif'),
(1534536737669598976, 'heboh tentang tiket candi borobudur 750rb, sbnrnya ada baik buruknya juga si.\n-Kalo tiket segitu bakal jarang bahkan jadi ngga ada pengunjung\n-Minimnya pengetahuan (secara real) tentang candi tersbut\n-Peninggalan yang harusnya di nikmati dan di jaga malah jd penglihatan semata', 'heboh tiket candi borobudur benar buruk tiket segitu jarang unjung minim tahu real candi tersbut tinggal nikmat jaga lihat', 'afira_tyas', '2022-06-08 14:04:03', 'negatif'),
(1534539790649283072, '@sungganteng Faktanya utk msk ke candi borobudur tdk dibedakan tujuannya wisata atau ibadah. Byr hrg tiket yg sama. Jgn beropini seolah2 jk ibadah nggak bayar. Akan jd mis information.', 'fakta masuk candi borobudur beda tuju wisata ibadah bayar harga tiket opini ibadah bayar information', 'Intannkri', '2022-06-08 14:16:11', 'positif'),
(1534540562099240960, 'Abis liat video ini, gua setuju sih kalau harga tiket borobudur naik. Terus td jg lewat penjelasan gubernur bahwa \"tiket masuk tetap sama, akan tetapi yg berbeda tiket saat naik ke candi yg berubah.\"\nhttps://t.co/f3AiNMm2dP', 'habis lihat video tuju harga tiket borobudur naik jelas gubernur tiket masuk beda tiket naik candi ubah', 'eajls', '2022-06-08 14:19:15', 'positif');
INSERT INTO `tbl_data_train` (`id`, `text`, `clean_text`, `user`, `created_at`, `label`) VALUES
(1534540816894479872, '@yashadipura aku mikirnya ini strategi marketing buat naikin trafik ke candi. toh update terbaru, kenaikan harga tiket ditunda. dijamin setelah ini, semua orang berbondong2 ke candi borobudur, sebelum tiket naik. ini kan momentum setelah pandemi yang harus dimanfaatkan.', 'pikir strategi marketing naik trafik candi update baru naik harga tiket tunda jamin bondong candi borobudur tiket naik kan momentum pandemi manfaat', 'anwarsuseno', '2022-06-08 14:20:15', 'negatif'),
(1534558697417936896, 'Cadangan menaikkan harga tiket adalah sebahagian usaha untuk memulihara kuil yang rosak akibat vandalisme.\nhttps://t.co/X2NI9NpfEP', 'cadang naik harga tiket sebahagian usaha memulihara kuil rosak akibat vandalisme', 'SinarOnline', '2022-06-08 15:31:18', 'positif'),
(1534567928779375104, '@yashadipura Yg sudah pernah ke candi Borobudur sich enak klw syA sich belum pernah sampai Disana juga tidak lokasi tempat nya udh mahal ajz tiket masuknya gk pa2 sich. Bagus itu di aman kan kelestarian budaya sehingga utuh sampai anak cucu kita kedepannya\nSupaya aman tergaja kelestariannya', 'candi borobudur enak sana lokasi mahal tiket masuk bagus aman kan lestari budaya utuh anak cucu depan aman jaga lestari', 'MegaParamita4', '2022-06-08 16:07:59', 'positif'),
(1534572920566996992, '@yashadipura Saya kurang setuju juga kalau di tutup buat wisata. Gimana kalau setiap orang yang ke Borobudur harus ditemani dengan guide. Setelah itu sebelum keluar dari kawasan Borobudur akan di test mengenai sejarah Borobudur. Yang tidak lolos harus bayar tiket HAHAHA', 'tuju tutup wisata borobudur tani guide keluar kawasan borobudur test sejarah borobudur lolos bayar tiket', 'adhiantos', '2022-06-08 16:27:49', 'negatif'),
(1534575302500033024, '@myputun Sebelumnya, harus dipahami bahwa harga tersebut berlaku bagi pengunjung yang ingin naik ke atas bangunan Candi Borobudur, sementara pengunjung yang ingin berwisata di pelataran candi, tiketnya masih berlaku harga normal.\n\nhttps://t.co/rZFKlghVoJ', 'paham harga laku unjung naik bangun candi borobudur unjung wisata latar candi tiket laku harga normal', 'rahmatrudi9', '2022-06-08 16:37:17', 'positif'),
(1534616164130643968, 'Kebijakan menaikan tiket masuk memang kontrofersial,tp bila tempat suci di injak ribuan kaki tiap hari dengan beralaskan kaki apa rela...? Mungkin bila naik ke puncak borobudur dengan melepaskan alas kaki tempat ini akan lebih suci mengingat ini tempat ibadah jg..???? https://t.co/Raukoey04v', 'bijak naik tiket masuk memang kontrofersial suci injak ribu kaki alas kaki rela mungkin naik puncak borobudur lepas alas kaki suci ingat ibadah', 'Kenjiro44585803', '2022-06-08 19:19:39', 'positif'),
(1534655493582757888, 'Candi Borobudur itu kan tempat ibadah. Harus nya yang urus tempat itu tokoh budha, pemerintah ga perlu ikut campur. Mestinya penganut agama budha bisa keluar masuk candi tanpa bayar. Harusnya bhikkhu setempat yang atur siapa yang boleh masuk atau tidak, bukan sekedar punya tiket. https://t.co/qhubS1zGBv', 'candi borobudur kan ibadah urus tokoh budha perintah campur mesti anut agama budha keluar masuk candi bayar biksu atur masuk tiket', 'bambangwiguna24', '2022-06-08 21:55:56', 'negatif'),
(1534656635976942080, 'Saya harap bapak @sandiuno tidak lupa, candi borobudur itu bukan sekedar tempat wisata. Itu adalah candi, tempat ibadahnya ummat budha. Jadi fikirkan juga kenyamanan mereka beribadah, jangan sekedar mikirin harga tiket masuk. https://t.co/StVOP2QoEW', 'harap lupa candi borobudur wisata candi ibadah ummat budha pikir nyaman ibadah pikir harga tiket masuk', 'bambangwiguna24', '2022-06-08 22:00:29', 'negatif'),
(1534684893296221952, '@yashadipura untung ada kenaikan tiket jdi keluar ide ini. sdh puluhan thn gak ada yg berani ngeluarin ide seperti ini.dimana mna tempat ibadah ya harus suci.cukup dri sekeliling candi aja klo mau menikmati kemegahan borobudur.', 'untung naik tiket keluar ide puluh berani ngeluarin ide mna ibadah iya suci keliling candi nikmat megah borobudur', 'kebomundarang', '2022-06-08 23:52:46', 'positif'),
