(1534691928364950016, '@RidhoarisusantP @yashadipura Jgn fokus ke duitnya, tp seberapa besar peluang tindakan menyimpang kalau aturannya longgar, udh tau belom ratusan arca budha di candi borobudur tanpa kepala, sebagian kecil rusak. Itu karena aturan dilonggarkan, ditambah harga tiket masuk yg murah, akhirnya boom! Ta terbendung', 'fokus duit peluang tindak simpang atur longgar ratus arca budha candi borobudur kepala kecil rusak atur longgar tambah harga tiket masuk murah boom ta bendung', 'syahdanmauladi', '2022-06-09 00:20:43', 'positif'),
