(1534731782959993088, 'Gw setuju ama Pak Luhut,yang tiket ke Candi Borobudur 750rb. Soalnya Candi Borobudur merupakan salahsatu ikon dari 7 keajaiban dunia,yang mana tidak bisa dimurah mareh...thanks pak Luhut????', 'tuju tiket candi borobudur candi borobudur salah lambang ajaib dunia murah mareh terima kasih', 'MardiUcup', '2022-06-09 02:59:05', 'positif'),
(1534732555337220096, 'Harga tiket Borobudur 50 rb, tulang mau naikin 750 rb, terus sepi pengunjung dan yg disalahkan pengelolaannya lalu ujung²nya kalau sudah sepi yah dijual deh..!!!\n???????????? https://t.co/vFNzu9Dcyl', 'harga tiket borobudur tulang naik sepi unjung salah kelola ujung sepi jual', 'P_etkLeeSegh', '2022-06-09 03:02:09', 'negatif'),
(1534769989953416960, 'Jika alasan Pemerintah menaikkan harga tiket ke Candi Borobudur untuk mencegah jumlah pengunjung. menurut kami tidak tepat apabila menggunakan pendekatan keuangan, kita bisa gunakan sistem kunjungan terjadwal.\n\n#BakomstraDemokrat https://t.co/JUt1JkVhxN', 'alas perintah naik harga tiket candi borobudur cegah unjung guna dekat uang guna sistem kunjung jadwal', 'BakomstraPD', '2022-06-09 05:30:54', 'negatif'),
(1534796574584638976, '@BossTemlen Prestasinya adalah menunda kenaikan tiket borobudur. Klo seniornya. Mindahin pasar.', 'prestasi tunda naik tiket borobudur senior pindah pasar', 'bluesuspect', '2022-06-09 07:16:33', 'negatif'),
(1534798146492301056, 'Tiket naik ke candi Borobudur jadi 750rb tentu banyak yg protes, ya gimana, bangunan lawas, banyak yg udah agak rusak, gak ada atap masa dihargai semahal itu? Manahan aja yg abis renovasi tiket termurahnya cuma 75rb dan termahal 250rb (belum sama biaya admin 5rb).', 'tiket naik candi borobudur protes iya bangun lawas agak rusak atap harga mahal manah habis renovasi tiket murah mahal biaya admin', 'agamoneanggono', '2022-06-09 07:22:47', 'negatif'),
(1534836845938618112, 'Terus, dengan menaikkan harga tiket masuk ke Candi Borobudur jadi 750 ribu apakah itu harga yang wajar? Itu malah justru mengurangi jumlah pengunjung yang akan datang kesana untuk berwisata dan mematikan para pedagang-pedagang yang ada di sekitar situ.', 'naik harga tiket masuk candi borobudur harga wajar kurang unjung kesana wisata mati dagang dagang', 'diva_acm', '2022-06-09 09:56:34', 'negatif'),
(1534852587836453120, '@democrazymedia Kalau tiket sampai 750 ribu,,rakyat gak bakan mau ke borobudur,,karena kemahalan,,jadi pendapatan dari borobudur akan turun derastis,,liat saja nanti,,\n\nMendingan 50 ribu tapi tiap minggu ada penghasilan...luhut nie berpikir tidak yaa??', 'tiket rakyat bak borobudur mahal dapat borobudur turun drastis lihat mending hasil pikir iya', 'Kardun65034867', '2022-06-09 10:59:07', 'negatif'),
(1534858849576189952, '@democrazymedia Masih banyak destinasi wisata yg bagus untuk  dikunjungi selain borobudur, aku yakin kalo tiket mahal, pasti sepi pengunjung. Mending untuk beli beras, sayur, ikan asin. Duit 750 rb sangat berharga bagi kami sekeluarga. Nggak tau kalo untuk LBP.', 'destinasi wisata bagus kunjung borobudur tiket mahal sepi unjung beli beras sayur ikan asin uang harga keluarga', 'ZainalM10798843', '2022-06-09 11:24:00', 'negatif'),
(1534866330871942912, 'Udah 3x ke Borobudur, dan ini yg terakhir… pas Krucils masih mini2… ????. Untung saat itu masih murah tiket naek nya. \nKalau tiap orang 750rb udah dapat patungan qurban sapi satu.. ????????.  Berpahala mending buat qurban saja.. https://t.co/3E8oSqlqRu', 'x borobudur pas krucils mini untung murah tiket naik patung qurban sapi pahala qurban', 'BundaDiyah', '2022-06-09 11:53:44', 'negatif'),
(1534871796750488064, 'Luhut berkata tentang rencana kenaikan harga tiket Borobudur :\n\n\"Semua yang saya kerjakan basisnya studi pak basisnya data,” tutupnya.\n\nJadi ingat BIG DATA 3 periode jokowi....???????????? https://t.co/IupZwRnZwT', 'rencana naik harga tiket borobudur kerja basis studi basis data tutup ingat big data periode jokowi', 'irwanstanjung', '2022-06-09 12:15:27', 'negatif'),
(1534914740052340992, '@theT4ntryS1 @4nggi4 @ganjarpranowo Menghargai PENINGGALAN SEJARAH BUDAYA apalagi artefak sekelas BOROBUDUR bukan berarti kita memberi HARGA MURAH. saya setuju harga tiket naik.', 'harga tinggal sejarah budaya artefak kelas borobudur harga murah tuju harga tiket naik', 'AdityaChristy2', '2022-06-09 15:06:06', 'positif'),
(1534917485237252096, 'Setelah baca dan memahami alesan kenapa Tiket Candi Borobudur naik jadi 750 ribu. Saya sangat setuju dengan langkah lord Luhut.', 'baca paham alas tiket candi borobudur naik tuju langkah lord', 'darwisbilang', '2022-06-09 15:17:00', 'positif'),
(1534931739012833024, 'Ini pasti karena harga tiket borobudur gajadi naik, jadi naikin aja kasusnya wkwkwk https://t.co/32W1w20KQA', 'harga tiket borobudur naik naik kasus tawa', 'blackyiee__', '2022-06-09 16:13:38', 'negatif'),
(1535039650447864064, 'Adapun rencana kenaikan harga tiket Candi Borobudur demi menjaga kelestarian kekayaan dan budaya nusantara.\n\nPelestarian ini adalah prinsip gotong royong utk mengembangkan Candi Borobudur sebagai laboratorium konservasi cagar budaya yang bertaraf internasional. ???????? https://t.co/d4w5fMeVXX', 'rencana naik harga tiket candi borobudur jaga lestari kaya budaya nusantara lestari prinsip gotong royong kembang candi borobudur laboratorium konservasi cagar budaya taraf internasional', 'SakiinaQhiCO_33', '2022-06-09 23:22:26', 'positif'),
(1535049463965789952, 'Harga tiket masuk Candi Borobudur demi melestarikan cagar budaya bertaraf internasional.\n\nCandi Borobudur salah satu warisan sejarah dunia yang harus kita jaga dan patut dilestarikan bersama-sama. https://t.co/pvH98YZEnS', 'harga tiket masuk candi borobudur lestari cagar budaya taraf internasional candi borobudur salah waris sejarah dunia jaga patut lestari', 'forjakeu', '2022-06-10 00:01:26', 'positif'),
(1535049604881711104, 'Konsep Candi Borobudur dikembangkan sebagai laboratorium konservasi cagar budaya bertaraf internasional. Nantinya ada tiket khusus naik Candi Borobudur Rp750.000.\nKenaikan tarif ini jelas sebagai upaya untuk menjaga kelestarian Kawasan Candi Borobudur https://t.co/4BTsHxIMtO', 'konsep candi borobudur kembang laboratorium konservasi cagar budaya taraf internasional tiket naik candi borobudur naik tarif jaga lestari kawasan candi borobudur', 'garuda080', '2022-06-10 00:02:00', 'positif'),
(1535049636100026112, 'Langkah pemerintah untuk menaikkan tiket masuk Candi Borobudur sudah sangat tepat.\n\nKenaikan tiket tersebut merupakan bentuk kelestarian kekayaan dan budaya Nusantara.\n\nKita juga harus menjaga bersama-sama karena cagar budaya Candi Borobudur bertaraf internasional. https://t.co/TrhNU5fPYC', 'langkah perintah naik tiket masuk candi borobudur naik tiket bentuk lestari kaya budaya nusantara jaga cagar budaya candi borobudur taraf internasional', 'kalla_jengking', '2022-06-10 00:02:07', 'positif'),
(1535049713875303936, 'Dukung kenaikan harga tiket Candi Borobudur...Yuk mari kita jaga kelestarian kekayaan dan budaya nusantara ini, Karena ini adalah tugas seluruh rakyat Indonesia, sebagai negara yang berbudaya, dimana beragam budaya ada disini di tanah air kita Indonesia???????????????? https://t.co/I923dnLHKQ', 'dukung naik harga tiket candi borobudur mari jaga lestari kaya budaya nusantara tugas rakyat indonesia negara budaya agam budaya sini tanah air indonesia', 'AliBej0', '2022-06-10 00:02:26', 'positif'),
(1535053070677159936, '1. Borobudur itu peninggalan sejarah dan tempat ibadah sudahlah sepantasnya dihormati oleh pengunjung yg datang .. wajar jika harga tiket naik ke candi Borobudur dinaikan selain utk menjaga kelestariannya juga utk menjaga kesucian tempat ibadah ..', 'borobudur tinggal sejarah ibadah hormat unjung wajar harga tiket naik candi borobudur naik jaga lestari jaga suci ibadah', 'ngaprak_nusa', '2022-06-10 00:15:46', 'positif'),
(1535085839755031040, 'Harga tiket yg tidak berperasaan.\nRakyat itu hiterogen kemampuan perekonomiannya, akan tetapi sama hak sebagai warga negara.\nHarga tiket 750 ribu itu pakai setandar apa. Borobudur itu milik bangsa Indonesia. https://t.co/A6M1S9h5ql', 'harga tiket rasa rakyat hiterogen mampu ekonomi hak negara harga tiket pakai setandar borobudur bangsa indonesia', 'ImamJumhuri', '2022-06-10 02:25:59', 'negatif'),
(1535137968113221888, 'https://t.co/HgO9d4xbUp \nStudi kayak apa..? Pendapatan rata2 penduduk lokal berapa? Loe kira dengan harga segitu umkm sekitar Borobudur terbantu..?\n\nTrus anggota DPR wajar jika mengkritik..emang tahu ndak tugas DPR terhadap pemerintah..?\n\nLoe bikin ribet sendiri..', 'studi dapat duduk lokal kira harga segitu umkm borobudur bantu anggota dpr wajar kritik tugas dpr perintah bikin ribet', 'KebenaranSelalu', '2022-06-10 05:53:07', 'negatif'),
(1535144181932252928, '@febridiansyah Hmm tiket Mahal?Apakah ini tujuan sbenarnya? Slain umat budha Tak boleh masuk?\nHmm barusan 2021 kmarin kesana kyk ada yg janggal?Jangan claims itu milik Budha,itu milik Rakyat KITA ????????????Maaf bebaskan bagi generasi kita mengunjungi Borobudur ????Angkor Wat dikunjungi 4,8jt/th&amp;gajah???? https://t.co/k3lAQGcgvF', 'tiket mahal tuju benar slain umat budha masuk barusan kesana janggal claims budha rakyat maaf bebas generasi unjung borobudur angkor kunjung th gajah', 'AfasaSembilan', '2022-06-10 06:17:49', 'negatif'),
(1535168525345893888, 'Ni lah gunanya kita bersuara lantang n keras di sosmed setiap kali ada kebijakan yg aneh2 n njelimet jgn sungkan tuk teriak ..!!\nKyk tiket msk candi Borobudur akhirna di tunda ..akibat penolakan yg kuat dr rakyat https://t.co/TA5Z3Xp8MU', 'guna suara lantang keras sosial media bijak aneh njelimet sungkan tuk teriak tiket masuk candi borobudur akhirna tunda akibat tolak kuat rakyat', 'SajeedaAde', '2022-06-10 07:54:33', 'negatif'),
(1535178859339034880, 'Bagi yang setuju, sebut tiket mahal #Borobudur untuk melindungi candi dari turis nakal. Seperti sejumlah wisatawan yang dengan santainya duduk-duduk di atas stupa candi Borobudur. https://t.co/ZgXBPvTsPa', 'tuju tiket mahal lindung candi turis nakal wisatawan santai duduk duduk stupa candi borobudur', 'detikcom', '2022-06-10 08:35:36', 'positif'),
(1535254922102418944, 'Sepakat kalo borobudur itu sakral. Tapi dengan membandrol harga tiket yg fantastis itu namanya logika komersialisasi, bukan logika menjaga kesakralan. Kalo mau mensakralkan ya jangan dijadiin objek buat cari cuan, apalagi cuan gede. https://t.co/fqMS5C1niS', 'sepakat borobudur sakral bandrol harga tiket fantastis nama logika komersialisasi logika jaga sakral sakral iya objek cari cuan cuan', 'domoococo', '2022-06-10 13:37:51', 'negatif'),
(1535289991806743040, '@MNW_MNW_MNW Betapa pemerintah memeras otak mencari sumber pendapatan negara, sampai seorang luhut mengurusi harga tiket masuk candi Borobudur. Kalau saya mending ke dufan atau ke universal studi sentosa island spore tiketnya hanya 610 rbu rupiah puas dgn berbagai wahana.', 'betapa perintah peras otak dapat negara urus harga tiket masuk candi borobudur dufan universal studi sentosa island tiket puas wahana', 'ica_astuti', '2022-06-10 15:57:13', 'negatif'),
(1536490889811738880, '@prastow Ga becus kerja lu ah. Gara gara hasil kerja lu bikin bangkrut, akhirnya rakyat yg harus nanggung beban, harga harga pada dinaikkin.\nSampe tiket candi Borobudur.\nKebanyakan makan duit proyek mangkrak sih lu.', 'becus kerja ah gara gara hasil kerja bikin bangkrut rakyat nanggung beban harga harga naik tiket candi borobudur banyak makan uang proyek mangkrak', 'the_schloss', '2022-06-13 23:29:09', 'negatif'),
(1536598109572083968, '@yunartowijaya Harga tiket masuk ke Candi Borobudur sebenarnya bukan untuk mencari keuntungan dari biaya perawatan. Tapi membatasi atau mengendalikan  pengunjung agar tidak merusak situs', 'harga tiket masuk candi borobudur untung biaya awat batas kendali unjung rusak situs', 'RaseMazid', '2022-06-14 06:35:12', 'positif'),
(1536617064500456960, '@CNNIndonesia Ini terlihat sekali bahwa pak LBP sengaja mengusulkan kenaikan harga tiket masuk di candi borobudur biar pak presiden kita tercinta membatalkan kenaikan tersebut biar masyarakat percaya bahwa pak presiden pro rakyat.', 'sengaja usul naik harga tiket masuk candi borobudur biar presiden cinta batal naik biar masyarakat percaya presiden tuju rakyat', 'AnasAlansyar_15', '2022-06-14 07:50:31', 'negatif'),
(1536709157658578944, 'Daripada naikin harga tiket , mending kukuhkan Candi Borobudur jadi tempat ibadah Buddha aja.\nOrang islam yg naik hukumnya sama kayak masuk gereja, gimana?.. Insya allah yg berani naik cuma banser doang', 'naik harga tiket kukuh candi borobudur ibadah buddha islam naik hukum masuk gereja insya allah berani naik banser', 'kata_atina', '2022-06-14 13:56:28', 'negatif'),
(1536847869885705984, 'Membatasi jumlah turis naik ke Candi dengan cara menaikkan harga tiket itu terasa kurang humanis. \n\nLebih manusiawi jika membatasi kuota harian, bagi para turis yang boleh naik ke Candi Borobudur itu rasanya lebih manusiawi. https://t.co/p88zNDm0j7', 'batas turis naik candi naik harga tiket humanis manusiawi batas kuota hari turis naik candi borobudur manusiawi', 'mokhulilhidayat', '2022-06-14 23:07:40', 'negatif'),
(1536899153040929024, '@kompascom menurut saya harga tiket dihitung dgn teliti sesuai dgn kempuan masyarakat serta rencana peningkatan sarana candi borobudur dn sekitarnya seperti lokasi parkir serta penataan tempat berjualan dn taman disekitar candi', 'harga tiket hitung teliti kempu masyarakat rencana tingkat sarana candi borobudur lokasi parkir tata jual taman sekitar candi', 'N34305884Achmad', '2022-06-15 02:31:26', 'positif');
