(1534350736779537920, 'Buat kalian yang belum paham bedanya tiket masuk dan naik, gini lebih gampangnya. Tiket masuk itu ke kawasan Candi Borobudur, kalian bisa jalan-jalan di kawasan Candi Borobudur sepuasnya. Tiket naik itu tiket kalau kamu pingin nanjak Candi Borobudur, lihat Stupa, dan Relief.', 'awaltawakal', '2022-06-08 01:44:57'),
(1534350769360883968, 'Lain kali kalau ngga mau tiket naik Candi Borobudur naik, kita harus ikut merawat situs budaya, ngga usah coret-coret Stupa atau naikin Stupa.\n\nSelalu ingat juga, cari informasi lebih lanjut dan akurat biar ngga jadi korban hoax!', 'awaltawakal', '2022-06-08 01:45:04'),
