(1534039882229686016, '@RAS01321241 @Dennysiregar7 @cokro_tv Dari zaman saya msh bocil, Borobudur itu tempat wisata. Ya nalar aja, kalau tempat ibadah kok ya pakai tiket masuk? Tempat ibadah mana yg kudu bayar kalau mau masuk?', '@ras01321241 @dennysiregar7 @cokro_tv dari zaman saya msh bocil, borobudur itu tempat wisata. ya nalar aja, kalau tempat ibadah kok ya pakai tiket masuk? tempat ibadah mana yg kudu bayar kalau mau masuk?', 'dari zaman saya msh bocil borobudur itu tempat wisata ya nalar aja kalau tempat ibadah kok ya pakai tiket masuk tempat ibadah mana yg kudu bayar kalau mau masuk', 'dari zaman saya masih bocil borobudur itu tempat wisata iya nalar saja kalau tempat ibadah kok iya pakai tiket masuk tempat ibadah mana yang harus bayar kalau mau masuk', ' zaman   bocil borobudur   wisata iya nalar    ibadah  iya pakai tiket masuk  ibadah    bayar   masuk', 'zaman bocil borobudur wisata iya nalar ibadah iya pakai tiket masuk ibadah bayar masuk', 'zaman bocil borobudur wisata iya nalar ibadah iya pakai tiket masuk ibadah bayar masuk', 'TriaAtmajaa', '2022-06-07 05:09:43', 'negatif'),
