(1534040349949059072, 'Kalo tiketnya di naikin 750k sbenrnya gapapa sih, toh itukan tiket buat naik ke candinya, kalo masuk komplek candi masih bisa di jangkau semua kalangan, dan poin plusnya candi borobudur juga bisa jadi lebih sakral buat umat hindu. https://t.co/ym1kd5vVQ5', 'kalo tiketnya di naikin 750k sbenrnya gapapa sih, toh itukan tiket buat naik ke candinya, kalo masuk komplek candi masih bisa di jangkau semua kalangan, dan poin plusnya candi borobudur juga bisa jadi lebih sakral buat umat hindu. https://t.co/ym1kd5vvq5', 'kalo tiketnya di naikin k sbenrnya gapapa sih toh itukan tiket buat naik ke candinya kalo masuk komplek candi masih bisa di jangkau semua kalangan dan poin plusnya candi borobudur juga bisa jadi lebih sakral buat umat hindu', 'kalau tiketnya di naik ke sebenarnya gapapa sih toh itukan tiket buat naik ke candinya kalau masuk komplek candi masih bisa di jangkau semua kalangan dan poin plusnya candi borobudur juga bisa jadi lebih sakral buat umat hindu', ' tiketnya  naik   gapapa   itukan tiket  naik  candinya  masuk komplek candi    jangkau  kalangan  poin plusnya candi borobudur     sakral  umat hindu', 'tiket naik gapapa itu tiket naik candi masuk komplek candi jangkau kalang poin plus candi borobudur sakral umat hindu', 'tiket naik gapapa itu tiket naik candi masuk komplek candi jangkau kalang poin plus candi borobudur sakral umat hindu', 'Tarjoees', '2022-06-07 05:11:35', 'positif'),
(1534040477376270080, '@Dina4rtya Berapa waktu lalu kita ke Borobudur, ngak bisa naik keatas , akhirnya kita batalin masuk ke @BorobudurJogja , ngapain jauh jauh datang ngak bisa melihat langsung, sekarang tiket udah naik 750k mending uang nya di tabung...boros amat ... #BOROBUDUR #WISATAJOGJA', '@dina4rtya berapa waktu lalu kita ke borobudur, ngak bisa naik keatas , akhirnya kita batalin masuk ke @borobudurjogja , ngapain jauh jauh datang ngak bisa melihat langsung, sekarang tiket udah naik 750k mending uang nya di tabung...boros amat ... #borobudur #wisatajogja', 'berapa waktu lalu kita ke borobudur ngak bisa naik keatas akhirnya kita batalin masuk ke ngapain jauh jauh datang ngak bisa melihat langsung sekarang tiket udah naik k mending uang nya di tabung boros amat', 'berapa waktu lalu kita ke borobudur tidak bisa naik keatas akhirnya kita batalkan masuk ke sedang apa jauh jauh datang tidak bisa melihat langsung sekarang tiket sudah naik ke lebih baik uang nya di tabung boros amat', '     borobudur   naik keatas   batalkan masuk         melihat   tiket  naik    uang   tabung boros ', 'borobudur naik atas batal masuk lihat tiket naik uang tabung boros', 'borobudur naik atas batal masuk lihat tiket naik uang tabung boros', 'ImeldaPutriAnis', '2022-06-07 05:12:05', 'negatif'),
