(1534069081296343040, 'Namun perlu diketahui, harga naik ke stupa candi dan tiket masuk area Candi Borobudur adalah dua hal yang berbeda. Kalau KawanWH mau masuk ke area candinya saja, saat ini wisatawan hanya dikenakan tarif sebesar Rp50.000 bagi orang dewasa dan Rp25.000 bagi anak-anak.', 'namun perlu diketahui, harga naik ke stupa candi dan tiket masuk area candi borobudur adalah dua hal yang berbeda. kalau kawanwh mau masuk ke area candinya saja, saat ini wisatawan hanya dikenakan tarif sebesar rp50.000 bagi orang dewasa dan rp25.000 bagi anak-anak.', 'namun perlu diketahui harga naik ke stupa candi dan tiket masuk area candi borobudur adalah dua hal yang berbeda kalau kawanwh mau masuk ke area candinya saja saat ini wisatawan hanya dikenakan tarif sebesar rp bagi orang dewasa dan rp bagi anak anak', 'namun perlu diketahui harga naik ke stupa candi dan tiket masuk area candi borobudur adalah dua hal yang berbeda kalau kawan mau masuk ke area candinya saja saat ini wisatawan hanya dikenakan tarif sebesar rupiah bagi orang dewasa dan rupiah bagi anak anak', '   harga naik  stupa candi  tiket masuk area candi borobudur     berbeda  kawan  masuk  area candinya    wisatawan  dikenakan tarif     dewasa    anak anak', 'harga naik stupa candi tiket masuk area candi borobudur beda kawan masuk area candi wisatawan kena tarif dewasa anak anak', 'harga naik stupa candi tiket masuk area candi borobudur beda kawan masuk area candi wisatawan kena tarif dewasa anak anak', 'kawanWH', '2022-06-07 07:05:45', 'positif'),
(1534069471576436992, 'Krn nongol singkat di iklan #FormulaESuksesMendunia , menginspirasi Opung utk menaikkan tiket masuk Borobudur.\n\nhttps://t.co/X7uMTFuetV', 'krn nongol singkat di iklan #formulaesuksesmendunia , menginspirasi opung utk menaikkan tiket masuk borobudur.\n\nhttps://t.co/x7umtfuetv', 'krn nongol singkat di iklan menginspirasi opung utk menaikkan tiket masuk borobudur', 'karena muncul singkat di iklan menginspirasi opung untuk menaikkan tiket masuk borobudur', ' muncul singkat  iklan menginspirasi   menaikkan tiket masuk borobudur', 'muncul singkat iklan inspirasi naik tiket masuk borobudur', 'muncul singkat iklan inspirasi naik tiket masuk borobudur', 'repoeblikan', '2022-06-07 07:07:18', NULL),
(1534070734431358976, 'Peninggalan sejarah Yunani Kuno milik seluruh manusia, jadi tiket masuknya gratis. Namun sejak krisis Yunani, pemerintahnya terpaksa ga gratisin, BU.\n\nUdah itu aja infonya.\nTarif Borobudur Rp750rb', 'peninggalan sejarah yunani kuno milik seluruh manusia, jadi tiket masuknya gratis. namun sejak krisis yunani, pemerintahnya terpaksa ga gratisin, bu.\n\nudah itu aja infonya.\ntarif borobudur rp750rb', 'peninggalan sejarah yunani kuno milik seluruh manusia jadi tiket masuknya gratis namun sejak krisis yunani pemerintahnya terpaksa ga gratisin bu udah itu aja infonya tarif borobudur rprb', 'peninggalan sejarah yunani kuno milik seluruh manusia jadi tiket masuknya gratis namun sejak krisis yunani pemerintahnya terpaksa tidak gratisin bu sudah itu saja infonya tarif borobudur rprb', 'peninggalan sejarah yunani kuno   manusia  tiket masuknya gratis   krisis yunani pemerintahnya terpaksa  gratisin bu    infonya tarif borobudur rprb', 'tinggal sejarah yunani kuno manusia tiket masuk gratis krisis yunani perintah paksa gratisin bu info tarif borobudur rprb', 'tinggal sejarah yunani kuno manusia tiket masuk gratis krisis yunani perintah paksa gratisin bu info tarif borobudur rprb', 'mang_kum', '2022-06-07 07:12:19', NULL),
(1534071590295547904, '@paknano @Zainuddinovic Saya belum pernah umroh dan naik haji, tapi klo keliling kecamatan Borobudur naik VW, Rik Rok dll udah. Klo menurutku udah bener dibatasi dgn kenaikan tiket plus gratis buat penganut Buddha yg mau sembahyang. Karena tujuannya sebenarnya untuk konservasi, bukan pusat agama Buddha', '@paknano @zainuddinovic saya belum pernah umroh dan naik haji, tapi klo keliling kecamatan borobudur naik vw, rik rok dll udah. klo menurutku udah bener dibatasi dgn kenaikan tiket plus gratis buat penganut buddha yg mau sembahyang. karena tujuannya sebenarnya untuk konservasi, bukan pusat agama buddha', 'saya belum pernah umroh dan naik haji tapi klo keliling kecamatan borobudur naik vw rik rok dll udah klo menurutku udah bener dibatasi dgn kenaikan tiket plus gratis buat penganut buddha yg mau sembahyang karena tujuannya sebenarnya untuk konservasi bukan pusat agama buddha', 'saya belum pernah umroh dan naik haji tapi kalau keliling kecamatan borobudur naik vw rik rok dan lain lain sudah kalau menurutku sudah benar dibatasi dengan kenaikan tiket plus gratis buat penganut buddha yang mau sembahyang karena tujuannya sebenarnya untuk konservasi bukan pusat agama buddha', '   umroh  naik haji   keliling kecamatan borobudur naik   rok      menurutku  benar dibatasi  kenaikan tiket plus gratis  penganut buddha   sembahyang  tujuannya   konservasi  pusat agama buddha', 'umroh naik haji keliling camat borobudur naik rok turut benar batas naik tiket plus gratis anut buddha sembahyang tuju konservasi pusat agama buddha', 'umroh naik haji keliling camat borobudur naik rok turut benar batas naik tiket plus gratis anut buddha sembahyang tuju konservasi pusat agama buddha', 'eleamaya', '2022-06-07 07:15:43', NULL),
(1534071944093389056, 'lucu juga sih. ada temen yang protes harga tiket naik candi borobudur 750K, ternyata dia udah pernah  ke sana tahun 2018 dan males naik. cuma duduk-duduk di taman aja. hihi.', 'lucu juga sih. ada temen yang protes harga tiket naik candi borobudur 750k, ternyata dia udah pernah  ke sana tahun 2018 dan males naik. cuma duduk-duduk di taman aja. hihi.', 'lucu juga sih ada temen yang protes harga tiket naik candi borobudur k ternyata dia udah pernah ke sana tahun dan males naik cuma duduk duduk di taman aja hihi', 'lucu juga sih ada teman yang protes harga tiket naik candi borobudur ke ternyata dia sudah pernah ke sana tahun dan malas naik cuma duduk duduk di taman saja hihi', 'lucu    teman  protes harga tiket naik candi borobudur          malas naik  duduk duduk  taman  ', 'lucu teman protes harga tiket naik candi borobudur malas naik duduk duduk taman', 'lucu teman protes harga tiket naik candi borobudur malas naik duduk duduk taman', 'elmanohara', '2022-06-07 07:17:07', 'negatif'),
(1534075826157010944, 'Bayangin, kalau netijen yg terakhir ke Borobudur pas studi tur sekolah 15 taun lalu aja bisa punya pengetahuan segitu dalamnya.. Siapa yg berani bilang kecerdasan dan literasi bangsa ini kacaw?\n\nPadahal info kenaikan harga tiket aja baru sepotong..', 'bayangin, kalau netijen yg terakhir ke borobudur pas studi tur sekolah 15 taun lalu aja bisa punya pengetahuan segitu dalamnya.. siapa yg berani bilang kecerdasan dan literasi bangsa ini kacaw?\n\npadahal info kenaikan harga tiket aja baru sepotong..', 'bayangin kalau netijen yg terakhir ke borobudur pas studi tur sekolah taun lalu aja bisa punya pengetahuan segitu dalamnya siapa yg berani bilang kecerdasan dan literasi bangsa ini kacaw padahal info kenaikan harga tiket aja baru sepotong', 'bayangkan kalau netijen yang terakhir ke borobudur pas studi tur sekolah tahun lalu saja bisa punya pengetahuan segitu dalamnya siapa yang berani bilang kecerdasan dan literasi bangsa ini kacau padahal informasi kenaikan harga tiket saja baru sepotong', 'bayangkan  netijen    borobudur pas studi tur sekolah      pengetahuan segitu dalamnya   berani bilang kecerdasan  literasi bangsa  kacau  informasi kenaikan harga tiket   sepotong', 'bayang netijen borobudur pas studi tur sekolah tahu segitu dalam berani bilang cerdas literasi bangsa kacau informasi naik harga tiket potong', 'bayang netijen borobudur pas studi tur sekolah tahu segitu dalam berani bilang cerdas literasi bangsa kacau informasi naik harga tiket potong', 'Pak_Irv', '2022-06-07 07:32:33', NULL),
