(1534125766367399936, 'Ngebahas tiket Borobudur itu ga usah bawa2 UMR Jogja yang rendah itu\n\nMereka ga butuh piknik ke Borobudur\n\nWong kmaren2 pas UMR nya dikritik aja bilang nya \"kalo ga kebanyakan gaya ya cukup..makan nasi kucing cukup\"', 'ngebahas tiket borobudur itu ga usah bawa2 umr jogja yang rendah itu\n\nmereka ga butuh piknik ke borobudur\n\nwong kmaren2 pas umr nya dikritik aja bilang nya \"kalo ga kebanyakan gaya ya cukup..makan nasi kucing cukup\"', 'ngebahas tiket borobudur itu ga usah bawa umr jogja yang rendah itu mereka ga butuh piknik ke borobudur wong kmaren pas umr nya dikritik aja bilang nya kalo ga kebanyakan gaya ya cukup makan nasi kucing cukup', 'bahas tiket borobudur itu tidak perlu bawa umr jogja yang rendah itu mereka tidak butuh piknik ke borobudur wong kmaren pas umr nya dikritik saja bilang nya kalau tidak kebanyakan gaya iya cukup makan nasi kucing cukup', 'bahas tiket borobudur    bawa umr jogja  rendah    butuh piknik  borobudur  kmaren pas umr  dikritik  bilang    kebanyakan gaya iya  makan nasi kucing ', 'bahas tiket borobudur bawa umr jogja rendah butuh piknik borobudur kmaren pas umr kritik bilang banyak gaya iya makan nasi kucing', 'bahas tiket borobudur bawa umr jogja rendah butuh piknik borobudur kmaren pas umr kritik bilang banyak gaya iya makan nasi kucing', 'yoboodricardo', '2022-06-07 10:51:00', NULL),
