(1534156568090258944, 'Bagi umat muslim egk usah resah dengan naiknya harga tiket masuk ke candi Borobudur,,pintu dan tangga mesjid di buka lebar untuk masuk dan gratis..', 'bagi umat muslim egk usah resah dengan naiknya harga tiket masuk ke candi borobudur,,pintu dan tangga mesjid di buka lebar untuk masuk dan gratis..', 'bagi umat muslim egk usah resah dengan naiknya harga tiket masuk ke candi borobudur pintu dan tangga mesjid di buka lebar untuk masuk dan gratis', 'bagi umat muslim egk perlu resah dengan naiknya harga tiket masuk ke candi borobudur pintu dan tangga mesjid di buka lebar untuk masuk dan gratis', ' umat muslim   resah  naiknya harga tiket masuk  candi borobudur pintu  tangga mesjid  buka lebar  masuk  gratis', 'umat muslim resah naik harga tiket masuk candi borobudur pintu tangga mesjid buka lebar masuk gratis', 'umat muslim resah naik harga tiket masuk candi borobudur pintu tangga mesjid buka lebar masuk gratis', 'Adhek_Byt', '2022-06-07 12:53:23', 'negatif'),
(1534156601363291904, '@venomest1 mestinya candi Borobudur dikembangkan menjadi wisata religius, jgn dijadikan destinasi wisata yg umumnya untuk peningkatan ekonomi\n\nsehingga tak ada tiket yg terkesan mahal bagi masyarakat, dan menghindari polemik yg tak baik\n\n*Borobudur itu tempat ibadah', '@venomest1 mestinya candi borobudur dikembangkan menjadi wisata religius, jgn dijadikan destinasi wisata yg umumnya untuk peningkatan ekonomi\n\nsehingga tak ada tiket yg terkesan mahal bagi masyarakat, dan menghindari polemik yg tak baik\n\n*borobudur itu tempat ibadah', 'mestinya candi borobudur dikembangkan menjadi wisata religius jgn dijadikan destinasi wisata yg umumnya untuk peningkatan ekonomi sehingga tak ada tiket yg terkesan mahal bagi masyarakat dan menghindari polemik yg tak baik borobudur itu tempat ibadah', 'mestinya candi borobudur dikembangkan menjadi wisata religius jangan dijadikan destinasi wisata yang umumnya untuk peningkatan ekonomi sehingga tidak ada tiket yang terkesan mahal bagi masyarakat dan menghindari polemik yang tidak baik borobudur itu tempat ibadah', 'mestinya candi borobudur dikembangkan  wisata religius  dijadikan destinasi wisata    peningkatan ekonomi    tiket  terkesan mahal  masyarakat  menghindari polemik    borobudur   ibadah', 'mesti candi borobudur kembang wisata religius jadi destinasi wisata tingkat ekonomi tiket kes mahal masyarakat hindar polemik borobudur ibadah', 'mesti candi borobudur kembang wisata religius jadi destinasi wisata tingkat ekonomi tiket kes mahal masyarakat hindar polemik borobudur ibadah', 'AzisDadun_', '2022-06-07 12:53:31', 'negatif'),
(1534158200265936896, 'Orang2 ini masih pada bahas tiket borobudur beserta pro dan kontra nya.\n\nHe, yg paling aneh itu bukan itunya. Tp yg ngomong tarifnya. Itu tarif berwisata tp yg menentukan bukan mentri nya?! Padahal ozil uda lama pulang. Negoro opo seh, dibayar rakyat tp jobdesk campur2 gajelas????', 'orang2 ini masih pada bahas tiket borobudur beserta pro dan kontra nya.\n\nhe, yg paling aneh itu bukan itunya. tp yg ngomong tarifnya. itu tarif berwisata tp yg menentukan bukan mentri nya?! padahal ozil uda lama pulang. negoro opo seh, dibayar rakyat tp jobdesk campur2 gajelas????', 'orang ini masih pada bahas tiket borobudur beserta pro dan kontra nya he yg paling aneh itu bukan itunya tp yg ngomong tarifnya itu tarif berwisata tp yg menentukan bukan mentri nya padahal ozil uda lama pulang negoro opo seh dibayar rakyat tp jobdesk campur gajelas', 'orang ini masih pada bahas tiket borobudur beserta setuju dan kontra nya he yang paling aneh itu bukan itunya tapi yang bicara tarifnya itu tarif berwisata tapi yang menentukan bukan mentri nya padahal ozil sudah lama pulang negoro apa seh dibayar rakyat tapi jobdesk campur tidak jelas', '    bahas tiket borobudur beserta setuju  kontra  he   aneh   itunya   bicara tarifnya  tarif berwisata   menentukan  mentri   ozil   pulang negoro  seh dibayar rakyat  jobdesk campur  ', 'bahas tiket borobudur serta tuju kontra he aneh itu bicara tarif tarif wisata tentu tri ozil pulang negoro seh bayar rakyat jobdesk campur', 'bahas tiket borobudur serta tuju kontra he aneh itu bicara tarif tarif wisata tentu tri ozil pulang negoro seh bayar rakyat jobdesk campur', 'kritenk_', '2022-06-07 12:59:52', NULL),
(1534158390422778112, 'Gue sih setuju bgt kalo tiket naik ke candi Borobudur jadi 750k, kl perlu 1 jt sekalian &amp; tegasin penjaga di situ biar orang2 ga bisa usil lagi.\n\nEmg kebanyakan masyarakat Indo cara negasinnya kalo ga dgn harga mahal ya digalakin. Tp kalo ngeyel digalakin nanti lapor ke sosmed ????????? https://t.co/XUpadmlAk6', 'gue sih setuju bgt kalo tiket naik ke candi borobudur jadi 750k, kl perlu 1 jt sekalian &amp; tegasin penjaga di situ biar orang2 ga bisa usil lagi.\n\nemg kebanyakan masyarakat indo cara negasinnya kalo ga dgn harga mahal ya digalakin. tp kalo ngeyel digalakin nanti lapor ke sosmed ????????? https://t.co/xupadmlak6', 'gue sih setuju bgt kalo tiket naik ke candi borobudur jadi k kl perlu jt sekalian amp tegasin penjaga di situ biar orang ga bisa usil lagi emg kebanyakan masyarakat indo cara negasinnya kalo ga dgn harga mahal ya digalakin tp kalo ngeyel digalakin nanti lapor ke sosmed', 'saya sih setuju banget kalau tiket naik ke candi borobudur jadi ke kalau perlu jt sekalian amp tegas penjaga di itu biar orang tidak bisa usil lagi memang kebanyakan masyarakat indo cara tegas kalau tidak dengan harga mahal iya galak tapi kalau ngeyel galak nanti lapor ke sosial media', '  setuju banget  tiket naik  candi borobudur         penjaga   biar    usil  memang kebanyakan masyarakat indo      harga mahal iya galak   ngeyel galak  lapor  sosial media', 'tuju banget tiket naik candi borobudur jaga biar usil memang banyak masyarakat indo harga mahal iya galak ngeyel galak lapor sosial media', 'tuju banget tiket naik candi borobudur jaga biar usil memang banyak masyarakat indo harga mahal iya galak ngeyel galak lapor sosial media', 'sindhukaton', '2022-06-07 13:00:38', 'positif'),
(1534158607817712128, 'Jika memang harga tiket masuk Borobudur dimahalkan maka pemerintah harus ketat mengawasi dan sepenuhnya membiayai perawatan situs penting dunia ini. \n\nJangan ada alasan; tidak ada dana maintenance Borobudur dengan apasan tidak adanyanya dana masuk karena sepinya penjualan tiket.', 'jika memang harga tiket masuk borobudur dimahalkan maka pemerintah harus ketat mengawasi dan sepenuhnya membiayai perawatan situs penting dunia ini. \n\njangan ada alasan; tidak ada dana maintenance borobudur dengan apasan tidak adanyanya dana masuk karena sepinya penjualan tiket.', 'jika memang harga tiket masuk borobudur dimahalkan maka pemerintah harus ketat mengawasi dan sepenuhnya membiayai perawatan situs penting dunia ini jangan ada alasan tidak ada dana maintenance borobudur dengan apasan tidak adanyanya dana masuk karena sepinya penjualan tiket', 'jika memang harga tiket masuk borobudur dimahalkan maka pemerintah harus ketat mengawasi dan sepenuhnya membiayai perawatan situs penting dunia ini jangan ada alasan tidak ada dana maintenance borobudur dengan apasan tidak adanyanya dana masuk karena sepinya penjualan tiket', ' memang harga tiket masuk borobudur dimahalkan maka pemerintah  ketat mengawasi  sepenuhnya membiayai perawatan situs  dunia    alasan   dana maintenance borobudur  apasan  adanyanya dana masuk  sepinya penjualan tiket', 'memang harga tiket masuk borobudur mahal maka perintah ketat awas sepenuh biaya awat situs dunia alas dana maintenance borobudur apas adanyanya dana masuk sepi jual tiket', 'memang harga tiket masuk borobudur mahal maka perintah ketat awas sepenuh biaya awat situs dunia alas dana maintenance borobudur apas adanyanya dana masuk sepi jual tiket', 'Nugroho11Eko', '2022-06-07 13:01:30', 'negatif'),
(1534159063084175104, 'Kenaikan harga masuk Candi Borobudur menjadi 750 ribu hanya untuk naik ke area stupa bukan harga tiket masuk. https://t.co/94qBSMyaTp', 'kenaikan harga masuk candi borobudur menjadi 750 ribu hanya untuk naik ke area stupa bukan harga tiket masuk. https://t.co/94qbsmyatp', 'kenaikan harga masuk candi borobudur menjadi ribu hanya untuk naik ke area stupa bukan harga tiket masuk', 'kenaikan harga masuk candi borobudur menjadi ribu hanya untuk naik ke area stupa bukan harga tiket masuk', 'kenaikan harga masuk candi borobudur     naik  area stupa  harga tiket masuk', 'naik harga masuk candi borobudur naik area stupa harga tiket masuk', 'naik harga masuk candi borobudur naik area stupa harga tiket masuk', 'infosemar3', '2022-06-07 13:03:18', NULL);
