(1534161548893037056, '@CNNIndonesia Luhut \"ditugaskan\" mengatasi harga minyak goreng yg meroket.\nHarga migor tidak turun, harga telur malah meroket jadi rp 30.000/kg dan tiket Borobudur naik 1.500%.\n\nJika masih punya malu, harusnya mundur semua karna tidak becus mengurus negara', '@cnnindonesia luhut \"ditugaskan\" mengatasi harga minyak goreng yg meroket.\nharga migor tidak turun, harga telur malah meroket jadi rp 30.000/kg dan tiket borobudur naik 1.500%.\n\njika masih punya malu, harusnya mundur semua karna tidak becus mengurus negara', 'luhut ditugaskan mengatasi harga minyak goreng yg meroket harga migor tidak turun harga telur malah meroket jadi rp kg dan tiket borobudur naik jika masih punya malu harusnya mundur semua karna tidak becus mengurus negara', 'luhut ditugaskan mengatasi harga minyak goreng yang meroket harga migor tidak turun harga telur bahkan meroket jadi rupiah kg dan tiket borobudur naik jika masih punya malu harusnya mundur semua karena tidak becus mengurus negara', ' ditugaskan mengatasi harga minyak goreng  meroket harga migor  turun harga telur  meroket     tiket borobudur naik    malu  mundur    becus mengurus negara', 'tugas atas harga minyak goreng roket harga migor turun harga telur roket tiket borobudur naik malu mundur becus urus negara', 'tugas atas harga minyak goreng roket harga migor turun harga telur roket tiket borobudur naik malu mundur becus urus negara', 'nizaminz', '2022-06-07 13:13:11', NULL),
