(1534322171266597120, 'Jika Memang Benar..Maka saya berterimakasih Pada Pemerintah, Karena Menunda Tarif Tiket Naik Ke Candi Borobudur\nWalaupun Itu bukan Kehendak hati, Tapi karena Tekanan Rakyat akan Pentingnya Mencintai Budaya Bangsa', 'jika memang benar..maka saya berterimakasih pada pemerintah, karena menunda tarif tiket naik ke candi borobudur\nwalaupun itu bukan kehendak hati, tapi karena tekanan rakyat akan pentingnya mencintai budaya bangsa', 'jika memang benar maka saya berterimakasih pada pemerintah karena menunda tarif tiket naik ke candi borobudur walaupun itu bukan kehendak hati tapi karena tekanan rakyat akan pentingnya mencintai budaya bangsa', 'jika memang benar maka saya terima kasih pada pemerintah karena menunda tarif tiket naik ke candi borobudur walaupun itu bukan kehendak hati tapi karena tekanan rakyat akan pentingnya mencintai budaya bangsa', ' memang benar maka  terima kasih  pemerintah  menunda tarif tiket naik  candi borobudur    kehendak hati   tekanan rakyat   mencintai budaya bangsa', 'memang benar maka terima kasih perintah tunda tarif tiket naik candi borobudur hendak hati tekan rakyat cinta budaya bangsa', 'memang benar maka terima kasih perintah tunda tarif tiket naik candi borobudur hendak hati tekan rakyat cinta budaya bangsa', 'Bagudek67', '2022-06-07 23:51:26', 'negatif'),
