(1534324944531643904, 'Menjaga kelestarian kekayaan dan budaya nusantara ini penting...Saya pribadi mendukung rencana pemerintah terkait konservasi Candi Borobudur yang telah ditetapkan sebagai Situs Warisan Dunia UNESCO.\n\nDukung kenaikan tiket, ini cara pembatasan kunjungan yg tepat. https://t.co/wLe1JTlQdO', 'menjaga kelestarian kekayaan dan budaya nusantara ini penting...saya pribadi mendukung rencana pemerintah terkait konservasi candi borobudur yang telah ditetapkan sebagai situs warisan dunia unesco.\n\ndukung kenaikan tiket, ini cara pembatasan kunjungan yg tepat. https://t.co/wle1jtlqdo', 'menjaga kelestarian kekayaan dan budaya nusantara ini penting saya pribadi mendukung rencana pemerintah terkait konservasi candi borobudur yang telah ditetapkan sebagai situs warisan dunia unesco dukung kenaikan tiket ini cara pembatasan kunjungan yg tepat', 'menjaga kelestarian kekayaan dan budaya nusantara ini penting saya pribadi mendukung rencana pemerintah terkait konservasi candi borobudur yang telah ditetapkan sebagai situs warisan dunia unesco dukung kenaikan tiket ini cara pembatasan kunjungan yang tepat', 'menjaga kelestarian kekayaan  budaya nusantara    pribadi mendukung rencana pemerintah terkait konservasi candi borobudur   ditetapkan  situs warisan dunia unesco dukung kenaikan tiket   pembatasan kunjungan  ', 'jaga lestari kaya budaya nusantara pribadi dukung rencana perintah kait konservasi candi borobudur tetap situs waris dunia unesco dukung naik tiket batas kunjung', 'jaga lestari kaya budaya nusantara pribadi dukung rencana perintah kait konservasi candi borobudur tetap situs waris dunia unesco dukung naik tiket batas kunjung', 'AliBej0', '2022-06-08 00:02:27', 'positif'),
(1534325081098158080, 'Membatasi dan menaikkan tiket wisatawan untuk naik ke Candi Borobudur adalah hal yg patut di berlakukan demi kelestariannya.\nCandi Borobudur adalah warisan leluhur, wajib kita rawat dan lestarikan\n\nIngat ya yang dimahalkan itu tiket untuk Naik ke Candi bukan masuk kawasan Candi https://t.co/siN1RrJTEH', 'membatasi dan menaikkan tiket wisatawan untuk naik ke candi borobudur adalah hal yg patut di berlakukan demi kelestariannya.\ncandi borobudur adalah warisan leluhur, wajib kita rawat dan lestarikan\n\ningat ya yang dimahalkan itu tiket untuk naik ke candi bukan masuk kawasan candi https://t.co/sin1rrjteh', 'membatasi dan menaikkan tiket wisatawan untuk naik ke candi borobudur adalah hal yg patut di berlakukan demi kelestariannya candi borobudur adalah warisan leluhur wajib kita rawat dan lestarikan ingat ya yang dimahalkan itu tiket untuk naik ke candi bukan masuk kawasan candi', 'membatasi dan menaikkan tiket wisatawan untuk naik ke candi borobudur adalah hal yang patut di berlakukan demi kelestariannya candi borobudur adalah warisan leluhur wajib kita rawat dan lestarikan ingat iya yang dimahalkan itu tiket untuk naik ke candi bukan masuk kawasan candi', 'membatasi  menaikkan tiket wisatawan  naik  candi borobudur    patut  berlakukan  kelestariannya candi borobudur  warisan leluhur wajib  rawat  lestarikan ingat iya  dimahalkan  tiket  naik  candi  masuk kawasan candi', 'batas naik tiket wisatawan naik candi borobudur patut laku lestari candi borobudur waris leluhur wajib rawat lestari ingat iya mahal tiket naik candi masuk kawasan candi', 'batas naik tiket wisatawan naik candi borobudur patut laku lestari candi borobudur waris leluhur wajib rawat lestari ingat iya mahal tiket naik candi masuk kawasan candi', 'garuda080', '2022-06-08 00:03:00', 'positif'),
