(1534350732136422912, 'Harga tiket Candi Borobudur sebesar Rp. 750.000 memang terasa ngga masuk akal buat wisatawan domestik. Tapi ternyata ada yang unik dari berita Kompas yang judulnya \"Luhut Umumkan Tiket Naik ke Candi Borobudur Rp. 750.000 bagi Turis Lokal\".', 'harga tiket candi borobudur sebesar rp. 750.000 memang terasa ngga masuk akal buat wisatawan domestik. tapi ternyata ada yang unik dari berita kompas yang judulnya \"luhut umumkan tiket naik ke candi borobudur rp. 750.000 bagi turis lokal\".', 'harga tiket candi borobudur sebesar rp memang terasa ngga masuk akal buat wisatawan domestik tapi ternyata ada yang unik dari berita kompas yang judulnya luhut umumkan tiket naik ke candi borobudur rp bagi turis lokal', 'harga tiket candi borobudur sebesar rupiah memang terasa tidak masuk akal buat wisatawan domestik tapi ternyata ada yang unik dari berita kompas yang judulnya luhut umumkan tiket naik ke candi borobudur rupiah bagi turis lokal', 'harga tiket candi borobudur   memang   masuk akal  wisatawan domestik     unik  berita   judulnya  umumkan tiket naik  candi borobudur   turis lokal', 'harga tiket candi borobudur memang masuk akal wisatawan domestik unik berita judul umum tiket naik candi borobudur turis lokal', 'harga tiket candi borobudur memang masuk akal wisatawan domestik unik berita judul umum tiket naik candi borobudur turis lokal', 'awaltawakal', '2022-06-08 01:44:56', NULL),
(1534350736779537920, 'Buat kalian yang belum paham bedanya tiket masuk dan naik, gini lebih gampangnya. Tiket masuk itu ke kawasan Candi Borobudur, kalian bisa jalan-jalan di kawasan Candi Borobudur sepuasnya. Tiket naik itu tiket kalau kamu pingin nanjak Candi Borobudur, lihat Stupa, dan Relief.', 'buat kalian yang belum paham bedanya tiket masuk dan naik, gini lebih gampangnya. tiket masuk itu ke kawasan candi borobudur, kalian bisa jalan-jalan di kawasan candi borobudur sepuasnya. tiket naik itu tiket kalau kamu pingin nanjak candi borobudur, lihat stupa, dan relief.', 'buat kalian yang belum paham bedanya tiket masuk dan naik gini lebih gampangnya tiket masuk itu ke kawasan candi borobudur kalian bisa jalan jalan di kawasan candi borobudur sepuasnya tiket naik itu tiket kalau kamu pingin nanjak candi borobudur lihat stupa dan relief', 'buat kalian yang belum paham bedanya tiket masuk dan naik gini lebih gampangnya tiket masuk itu ke kawasan candi borobudur kalian bisa jalan jalan di kawasan candi borobudur sepuasnya tiket naik itu tiket kalau kamu ingin nanjak candi borobudur lihat stupa dan relief', '    paham bedanya tiket masuk  naik   gampangnya tiket masuk   kawasan candi borobudur   jalan jalan  kawasan candi borobudur sepuasnya tiket naik  tiket    nanjak candi borobudur lihat stupa  relief', 'paham beda tiket masuk naik gampang tiket masuk kawasan candi borobudur jalan jalan kawasan candi borobudur puas tiket naik tiket nanjak candi borobudur lihat stupa relief', 'paham beda tiket masuk naik gampang tiket masuk kawasan candi borobudur jalan jalan kawasan candi borobudur puas tiket naik tiket nanjak candi borobudur lihat stupa relief', 'awaltawakal', '2022-06-08 01:44:57', 'positif'),
(1534350769360883968, 'Lain kali kalau ngga mau tiket naik Candi Borobudur naik, kita harus ikut merawat situs budaya, ngga usah coret-coret Stupa atau naikin Stupa.\n\nSelalu ingat juga, cari informasi lebih lanjut dan akurat biar ngga jadi korban hoax!', 'lain kali kalau ngga mau tiket naik candi borobudur naik, kita harus ikut merawat situs budaya, ngga usah coret-coret stupa atau naikin stupa.\n\nselalu ingat juga, cari informasi lebih lanjut dan akurat biar ngga jadi korban hoax!', 'lain kali kalau ngga mau tiket naik candi borobudur naik kita harus ikut merawat situs budaya ngga usah coret coret stupa atau naikin stupa selalu ingat juga cari informasi lebih lanjut dan akurat biar ngga jadi korban hoax', 'lain kali kalau tidak mau tiket naik candi borobudur naik kita harus ikut merawat situs budaya tidak perlu coret coret stupa atau naik stupa selalu ingat juga cari informasi lebih lanjut dan akurat biar tidak jadi korban isu bohong', '     tiket naik candi borobudur naik    merawat situs budaya   coret coret stupa  naik stupa  ingat  cari informasi    akurat biar   korban isu bohong', 'tiket naik candi borobudur naik rawat situs budaya coret coret stupa naik stupa ingat cari informasi akurat biar korban isu bohong', 'tiket naik candi borobudur naik rawat situs budaya coret coret stupa naik stupa ingat cari informasi akurat biar korban isu bohong', 'awaltawakal', '2022-06-08 01:45:04', 'positif'),
