(1534354414294958080, 'Harusnya semua keputusan tentang pengelolaan, termasuk tiket dan jumlah pengunjung Borobudur, ditentukan oleh umat Buddha. Dan yang lain harusnya bisa menerima kalau sudah diputuskan.', 'harusnya semua keputusan tentang pengelolaan, termasuk tiket dan jumlah pengunjung borobudur, ditentukan oleh umat buddha. dan yang lain harusnya bisa menerima kalau sudah diputuskan.', 'harusnya semua keputusan tentang pengelolaan termasuk tiket dan jumlah pengunjung borobudur ditentukan oleh umat buddha dan yang lain harusnya bisa menerima kalau sudah diputuskan', 'harusnya semua keputusan tentang pengelolaan termasuk tiket dan jumlah pengunjung borobudur ditentukan oleh umat buddha dan yang lain harusnya bisa menerima kalau sudah diputuskan', '  keputusan  pengelolaan  tiket   pengunjung borobudur ditentukan  umat buddha      menerima   diputuskan', 'putus kelola tiket unjung borobudur tentu umat buddha terima putus', 'putus kelola tiket unjung borobudur tentu umat buddha terima putus', 'hasyimmah', '2022-06-08 01:59:33', 'negatif'),
