(1534455521310170880, 'Harga tiket Borobudur lagi murah aja pada ga ngunjungin, giliran harga naek baru bilang, \"ga akan pernah bisa ngunjungin.\"\n\nPelajari dulu alasannya kenapa harga tiketnya naik, adanya pembatasan kunjungan dan larangan memasuki/memanjat area Candi yang paling dalam.', 'harga tiket borobudur lagi murah aja pada ga ngunjungin, giliran harga naek baru bilang, \"ga akan pernah bisa ngunjungin.\"\n\npelajari dulu alasannya kenapa harga tiketnya naik, adanya pembatasan kunjungan dan larangan memasuki/memanjat area candi yang paling dalam.', 'harga tiket borobudur lagi murah aja pada ga ngunjungin giliran harga naek baru bilang ga akan pernah bisa ngunjungin pelajari dulu alasannya kenapa harga tiketnya naik adanya pembatasan kunjungan dan larangan memasuki memanjat area candi yang paling dalam', 'harga tiket borobudur lagi murah saja pada tidak ngunjungin giliran harga naik baru bilang tidak akan pernah bisa ngunjungin pelajari dulu alasannya kenapa harga tiketnya naik adanya pembatasan kunjungan dan larangan memasuki memanjat area candi yang paling dalam', 'harga tiket borobudur  murah    ngunjungin giliran harga naik  bilang     ngunjungin pelajari  alasannya  harga tiketnya naik  pembatasan kunjungan  larangan memasuki memanjat area candi   dalam', 'harga tiket borobudur murah ngunjungin gilir harga naik bilang ngunjungin ajar alas harga tiket naik batas kunjung larang pasuk panjat area candi dalam', 'harga tiket borobudur murah ngunjungin gilir harga naik bilang ngunjungin ajar alas harga tiket naik batas kunjung larang pasuk panjat area candi dalam', 'satembek', '2022-06-08 08:41:19', 'positif'),
