(1535049463965789952, 'Harga tiket masuk Candi Borobudur demi melestarikan cagar budaya bertaraf internasional.\n\nCandi Borobudur salah satu warisan sejarah dunia yang harus kita jaga dan patut dilestarikan bersama-sama. https://t.co/pvH98YZEnS', 'harga tiket masuk candi borobudur demi melestarikan cagar budaya bertaraf internasional.\n\ncandi borobudur salah satu warisan sejarah dunia yang harus kita jaga dan patut dilestarikan bersama-sama. https://t.co/pvh98yzens', 'harga tiket masuk candi borobudur demi melestarikan cagar budaya bertaraf internasional candi borobudur salah satu warisan sejarah dunia yang harus kita jaga dan patut dilestarikan bersama sama', 'harga tiket masuk candi borobudur demi melestarikan cagar budaya bertaraf internasional candi borobudur salah satu warisan sejarah dunia yang harus kita jaga dan patut dilestarikan bersama sama', 'harga tiket masuk candi borobudur  melestarikan cagar budaya bertaraf internasional candi borobudur salah  warisan sejarah dunia    jaga  patut dilestarikan  ', 'harga tiket masuk candi borobudur lestari cagar budaya taraf internasional candi borobudur salah waris sejarah dunia jaga patut lestari', 'harga tiket masuk candi borobudur lestari cagar budaya taraf internasional candi borobudur salah waris sejarah dunia jaga patut lestari', 'forjakeu', '2022-06-10 00:01:26', 'positif'),
