(1535049636100026112, 'Langkah pemerintah untuk menaikkan tiket masuk Candi Borobudur sudah sangat tepat.\n\nKenaikan tiket tersebut merupakan bentuk kelestarian kekayaan dan budaya Nusantara.\n\nKita juga harus menjaga bersama-sama karena cagar budaya Candi Borobudur bertaraf internasional. https://t.co/TrhNU5fPYC', 'langkah pemerintah untuk menaikkan tiket masuk candi borobudur sudah sangat tepat.\n\nkenaikan tiket tersebut merupakan bentuk kelestarian kekayaan dan budaya nusantara.\n\nkita juga harus menjaga bersama-sama karena cagar budaya candi borobudur bertaraf internasional. https://t.co/trhnu5fpyc', 'langkah pemerintah untuk menaikkan tiket masuk candi borobudur sudah sangat tepat kenaikan tiket tersebut merupakan bentuk kelestarian kekayaan dan budaya nusantara kita juga harus menjaga bersama sama karena cagar budaya candi borobudur bertaraf internasional', 'langkah pemerintah untuk menaikkan tiket masuk candi borobudur sudah sangat tepat kenaikan tiket tersebut merupakan bentuk kelestarian kekayaan dan budaya nusantara kita juga harus menjaga bersama sama karena cagar budaya candi borobudur bertaraf internasional', 'langkah pemerintah  menaikkan tiket masuk candi borobudur    kenaikan tiket   bentuk kelestarian kekayaan  budaya nusantara    menjaga    cagar budaya candi borobudur bertaraf internasional', 'langkah perintah naik tiket masuk candi borobudur naik tiket bentuk lestari kaya budaya nusantara jaga cagar budaya candi borobudur taraf internasional', 'langkah perintah naik tiket masuk candi borobudur naik tiket bentuk lestari kaya budaya nusantara jaga cagar budaya candi borobudur taraf internasional', 'kalla_jengking', '2022-06-10 00:02:07', 'positif'),
