(1536847869885705984, 'Membatasi jumlah turis naik ke Candi dengan cara menaikkan harga tiket itu terasa kurang humanis. \n\nLebih manusiawi jika membatasi kuota harian, bagi para turis yang boleh naik ke Candi Borobudur itu rasanya lebih manusiawi. https://t.co/p88zNDm0j7', 'membatasi jumlah turis naik ke candi dengan cara menaikkan harga tiket itu terasa kurang humanis. \n\nlebih manusiawi jika membatasi kuota harian, bagi para turis yang boleh naik ke candi borobudur itu rasanya lebih manusiawi. https://t.co/p88zndm0j7', 'membatasi jumlah turis naik ke candi dengan cara menaikkan harga tiket itu terasa kurang humanis lebih manusiawi jika membatasi kuota harian bagi para turis yang boleh naik ke candi borobudur itu rasanya lebih manusiawi', 'membatasi jumlah turis naik ke candi dengan cara menaikkan harga tiket itu terasa kurang humanis lebih manusiawi jika membatasi kuota harian bagi para turis yang boleh naik ke candi borobudur itu rasanya lebih manusiawi', 'membatasi  turis naik  candi   menaikkan harga tiket    humanis  manusiawi  membatasi kuota harian   turis   naik  candi borobudur    manusiawi', 'batas turis naik candi naik harga tiket humanis manusiawi batas kuota hari turis naik candi borobudur manusiawi', 'batas turis naik candi naik harga tiket humanis manusiawi batas kuota hari turis naik candi borobudur manusiawi', 'mokhulilhidayat', '2022-06-14 23:07:40', 'negatif'),
