(1536998796038550016, '(5)\"Mumpung akhir pekan, ringan2 saja Twit-nya. Sejalan dgn Protes Rencana Kenaikan Harga Tiket naik ke Candi Borobudur (dari 50rb) ke 750rb yg (sdh sewarasnya) DITUNDA itu,', '(5)\"mumpung akhir pekan, ringan2 saja twit-nya. sejalan dgn protes rencana kenaikan harga tiket naik ke candi borobudur (dari 50rb) ke 750rb yg (sdh sewarasnya) ditunda itu,', 'mumpung akhir pekan ringan saja twit nya sejalan dgn protes rencana kenaikan harga tiket naik ke candi borobudur dari rb ke rb yg sdh sewarasnya ditunda itu', 'selagi akhir pekan ringan saja twit nya sejalan dengan protes rencana kenaikan harga tiket naik ke candi borobudur dari rb ke rb yang sudah sewarasnya ditunda itu', '   ringan  twit  sejalan  protes rencana kenaikan harga tiket naik  candi borobudur       sewarasnya ditunda ', 'ringan twit jalan protes rencana naik harga tiket naik candi borobudur waras tunda', 'ringan twit jalan protes rencana naik harga tiket naik candi borobudur waras tunda', 'TogarHasibu4n', '2022-06-15 09:07:23', NULL),
(1537024374577970944, 'ringan2 saja Twit-nya. Sejalan dgn protes Kenaikan Harga Tiket naik ke Candi Borobudur (dari 50rb) ke 750rb yg (sudah sewarasnya) DITUNDA itu, Banyak Kreativitas Netizen mengubah Salahsatu Stupa terbuka yg Ikonik di Borobudur itu, LUCU, he-3x AMBYAR.” \n\nTwit KRMT Roy Suryo yang', 'ringan2 saja twit-nya. sejalan dgn protes kenaikan harga tiket naik ke candi borobudur (dari 50rb) ke 750rb yg (sudah sewarasnya) ditunda itu, banyak kreativitas netizen mengubah salahsatu stupa terbuka yg ikonik di borobudur itu, lucu, he-3x ambyar.” \n\ntwit krmt roy suryo yang', 'ringan saja twit nya sejalan dgn protes kenaikan harga tiket naik ke candi borobudur dari rb ke rb yg sudah sewarasnya ditunda itu banyak kreativitas netizen mengubah salahsatu stupa terbuka yg ikonik di borobudur itu lucu he x ambyar twit krmt roy suryo yang', 'ringan saja twit nya sejalan dengan protes kenaikan harga tiket naik ke candi borobudur dari rb ke rb yang sudah sewarasnya ditunda itu banyak kreativitas netizen mengubah salah satu stupa terbuka yang ikonik di borobudur itu lucu he x ambyar twit krmt roy suryo yang', 'ringan  twit  sejalan  protes kenaikan harga tiket naik  candi borobudur       sewarasnya ditunda   kreativitas netizen mengubah salah  stupa terbuka  ikonik  borobudur  lucu he x ambyar twit krmt  suryo ', 'ringan twit jalan protes naik harga tiket naik candi borobudur waras tunda kreativitas netizen ubah salah stupa buka ikonik borobudur lucu he x ambyar twit krmt suryo', 'ringan twit jalan protes naik harga tiket naik candi borobudur waras tunda kreativitas netizen ubah salah stupa buka ikonik borobudur lucu he x ambyar twit krmt suryo', 'Ndheso_', '2022-06-15 10:49:02', NULL),
(1537047460819836928, 'Ternyata akal-akalan rezim untuk belanjakan wang rakyat\n\nhttps://t.co/VqIpIF77y9\n\nPemerintah membatalkan rencana kenaikan harga tiket naik Candi Borobudur. Lalu apa upaya pemerintah mempercantik Borobudur saat tidak ada kenaikan tiket?', 'ternyata akal-akalan rezim untuk belanjakan wang rakyat\n\nhttps://t.co/vqipif77y9\n\npemerintah membatalkan rencana kenaikan harga tiket naik candi borobudur. lalu apa upaya pemerintah mempercantik borobudur saat tidak ada kenaikan tiket?', 'ternyata akal akalan rezim untuk belanjakan wang rakyat pemerintah membatalkan rencana kenaikan harga tiket naik candi borobudur lalu apa upaya pemerintah mempercantik borobudur saat tidak ada kenaikan tiket', 'ternyata akal akalan rezim untuk belanjakan wang rakyat pemerintah membatalkan rencana kenaikan harga tiket naik candi borobudur lalu apa upaya pemerintah mempercantik borobudur saat tidak ada kenaikan tiket', ' akal akalan rezim  belanjakan wang rakyat pemerintah membatalkan rencana kenaikan harga tiket naik candi borobudur    pemerintah mempercantik borobudur    kenaikan tiket', 'akal akal rezim belanja wang rakyat perintah batal rencana naik harga tiket naik candi borobudur perintah cantik borobudur naik tiket', 'akal akal rezim belanja wang rakyat perintah batal rencana naik harga tiket naik candi borobudur perintah cantik borobudur naik tiket', 'PuspenCebong', '2022-06-15 12:20:46', NULL);
